INSERT INTO Services VALUES('21','Dollar for Debt Forgiveness','7','9','Active','Most hospitals offer discounts or bill forgiveness based on income. On average, a family of 4 earning less than $100,000 a year will qualify. We can help you apply — for free.','Apply Online','','','NONE','24','134','No listed language support','135','24');
INSERT INTO Services VALUES('22','FailSafe for Life','7','10','Active',replace('Education and Community Events for Suicide Prevention.\n\nSaturation Training\n“Saturation Training” or basic education to the key\ngatekeepers laid out in the National Strategy for Suicide\nPrevention along with any other interested party. \n\nAdvanced Training\nAdvanced level training for helping professions or those who\nwould be providing emergency and/or ongoing care.\n\nAwareness Campaigns\nAwareness campaigns to bring this issue to the attention of\nthe community.\n\nCoordination with the Media\nWorking with the media to promote proper coverage and\nprevent contagion.\n\nSupporting Prevention Methods\nSupporting means restriction as an effective method of prevention.\n\nCommunity Involvement\nWorking with existing organizations and groups to create a\ncollaborative, efficient effort.','\n',char(10)),'Call during regular business hours.','','','NONE','25','135','No listed language support','136','25');
