INSERT INTO Services VALUES('26','Case Management','9','17','Active','Offers parents the opportunity to have parent support, goal setting, and community resources to help them be the parent they want to be with support from our compassionate circle of security-trained case manager. For more information contact Sarah Durrant at sarah.durrant@cceasternwa.org.','Apply online.','','',replace('All CAPA/PREPARES services offered are free of charge to any parent, guardian, or caregiver of any child aged 0-5.\n\nApply online for eligibility.','\n',char(10)),'29','139','No listed language support','140','29');
INSERT INTO Services VALUES('27','Circle of Security Parenting Classes','9','17','Active','Circle of Security® Parenting™ (COSP) teaches parents to identify, understand and respond to their child''s emotional needs. Through COSP, parents discover they are capable of connecting with, loving, and raising secure children. CAPA/PREPARES offers the 8-week COSP group quarterly for parents of children aged six months to five years old.','Apply online.','','',replace('All CAPA/PREPARES services offered are free of charge to any parent, guardian, or caregiver of any child aged 0-5.\n\nApply online for eligibility.','\n',char(10)),'30','140','No listed language support','141','30');
INSERT INTO Services VALUES('28','Education Support','9','17','Active',replace('EDUCATION SUPPORT\nEducation support focuses on families with children ages three to five, to prepare them for kindergarten. The program is led by a CAPA/PREPARES Education Support Specialist with over thirty years of experience in education. This provides an extra layer of support giving children the tools they need to be successful in their first years of schooling and providing ongoing support to parents navigating this new system. Education support also provides GED and ESL support for mothers and fathers. For more information contact Sandi Nokes at Sandi.nokes@cceasternwa.org.','\n',char(10)),'Apply online.','','',replace('All CAPA/PREPARES services offered are free of charge to any parent, guardian, or caregiver of any child aged 0-5.\n\nApply online for eligibility.','\n',char(10)),'31','141','No listed language support','142','31');
INSERT INTO Services VALUES('29','Essential Items','9','17','Active',replace('CLOTHING (SIZES NEWBORN - 5T) ONCE EVERY 60 DAYS.\nTo place an order for clothing, please allow two business days to fill your order. Pick up available during walk-in hours.\n\nOTHER ESSENTIAL ITEMS, ONCE EVERY 60 DAYS\nItems include pack n'' plays, highchairs, baby gates, strollers, baby baths, and more. (Please attach your other essential items with your clothing order).','\n',char(10)),'Apply online.','','',replace('All CAPA/PREPARES services offered are free of charge to any parent, guardian, or caregiver of any child aged 0-5.\n\nApply online for eligibility.','\n',char(10)),'32','142','No listed language support','143','32');
