INSERT INTO Services VALUES('31','Prepared Moms','9','17','Active','A weekly social support group for moms with children under the age of five. Join us in building friendships, fostering community, and supporting one another in navigating parenthood on Thursdays from 10-11:30 am. Mothers of children aged 0-5 can attend on a drop-in basis and receive free childcare during group.','Apply online','','',replace('All CAPA/PREPARES services offered are free of charge to any parent, guardian, or caregiver of any child aged 0-5.\n\nApply online for eligibility.','\n',char(10)),'34','144','No listed language support','145','34');
