INSERT INTO Services VALUES('37','Immigration Legal Services','11','14','Active',replace('Immigration Legal Services provides high-quality legal consultations, representation, and assistance to documented and undocumented immigrants of all nationalities, ethnicities, and religions.\nOur primary goals are to promote the reunification of families and to assist the integration of newcomers successfully into our community.\nEach client is treated professionally and confidentially by our staff. If we are unable to provide assistance on a particular matter, we are able to refer individuals to a variety of local resources.','\n',char(10)),'Call during regular business hours.','','','NONE','41','151','No listed language support','152','41');
INSERT INTO Services VALUES('38','Integrated Case Management (ICM)','11','15','Active','Integrated Case Management assists people in stabilizing their housing, income, behavioral health, and/or substance use. Integrated Case Management empowers individuals and families to achieve their own goals of economic mobility and self-sufficiency through supportive housing, supported employment, and peer support services, and works to help clients access behavioral health, substance use disorder, and healthcare services directly and efficiently, in order to provide our clients with high-quality and holistic services.','Call during regular business hours.','','','NONE','42','152','No listed language support','153','42');
INSERT INTO Services VALUES('39','Rising Strong','11','23','Active',replace('Rising Strong is a holistic, family-centered drug treatment and housing program supporting families in staying together while they begin to recover from addiction, heal from trauma and rebuild their lives.\n\nRising Strong provides assessments and plans for each family member (parents and children).\n\nParents will receive a variety of services, including:?\nRecovery Coaching, Counseling, Parenting Skills, Education Support, Vocational Training\n\nChildren will receive a variety of services, including:\nEarly learning opportunities, High-quality child care, Educational Support, Mental Health screening and treatment, Recreational Activities, Parent engagement through evidence-based parenting programs.\n\n--------------------------------------------------\nCORE ELEMENTS\n\nSafe Housing:\nFamily will reside in Rising Strong Community for 12-18 months.\n\nSubstance Abuse Recovery:\nSubstance abuse services on site for adults and teens.\n\nClinical Support-Adults:\nMental health assessments and services provided on-site.\n\nEducation and Employment:\nEducation support for adults and children.\n\nChild Assessment and Treatment:\nAll children receive comprehensive age-appropriate assessment and treatment.\n\nIntegrated Family Treatment:\nServices provided to restore maximum family functioning.\n\nAfter Care:\nLong-term affordable housing, support, and services provided to program graduates.','\n',char(10)),'Call or email to schedule an appointment.','','checked','Provided during intakte.','43','153','No listed language support','154','43');
INSERT INTO Services VALUES('40','St. Anne''s Children & Family Center','11','17','Waitlist Only',replace('St. Anne''s Children & Family Center provides high-quality child care and early learning experiences for children of all faith ranging in age from 1 month through 6 years. We are an exemplary early learning center with highly educated and experienced staff who demonstrate professionalism and a passion for children. We are committed to meeting and exceeding all quality and educational standards for our center and for each child we serve.\n\nSt. Anne’s Provides:\n- Secure Locked Facility\n- Trauma Informed Social Emotional Educational program for infants, toddlers, and preschoolers focused on the individual child\n- Qualified and nurturing teachers who have degrees in Education, Early Childhood Education and/ or STARS training\n- 14 separate classrooms, multiple indoor large motor areas, three outdoor play areas, as well as a covered rooftop play area\n- 2 areas specializing in S.T.E.A.M (Science, Technology, Engineering, Arts, & Mathematics)\n- Family library\n- Community Garden\n- An award-winning menu with a wide variety of healthy nutritious foods, nutritional education, and farm to table program','\n',char(10)),'Monday - Friday, 7 AM - 5:30 PM','','','NONE','44','154','No listed language support','155','44');
INSERT INTO Services VALUES('41','The Catalyst Project','11','18','Active',replace('The Catalyst Project is an emergency supportive housing program that will create a new pathway out of homelessness for people in our community. The Catalyst Project can provide a strategic enhancement to our current regional shelter system by providing 87 rooms to both men and women experiencing homelessness. In addition, 14 of the 87 rooms will be set aside for double occupancy.\n\nKey Features:\n- Fully staffed security team who will patrol 24 hours a day, seven days a week, around a fenced and secured area.\n- Robust Care Coordination services, including housing-focused opportunities, connections to behavioral health services, primary care, and public benefits.\n- Contracted food services to provide three meals a day.\n- Residents will abide by Catalyst’s Good Neighbor Agreement.','\n',char(10)),'Call during regular business hours.','','','Must be homeless or facing homelessness.','45','155','No listed language support','156','45');
INSERT INTO Services VALUES('42','Infants Program (4 weeks - 12 months)','12','19','Active',replace('Ratios are 4:1 for Infants\n\nWe have two classrooms of Infants, ages 4 weeks to 12 months, maximum group size of 8 per room\n\nUSDA approved Breakfast, Lunch and Snack are provided beginning at 12 months.','\n',char(10)),'Mon – Fri: 7am – 6pm','','','NONE','46','156','No listed language support','157','46');
INSERT INTO Services VALUES('216','Food Distribution Center','87','20','Active','Are you in need of assistance? Please reach out for more information. Or stop by.',replace('Mondays, 4 PM - 6 PM\nWednesdays, 9 AM - 11:30 AM','\n',char(10)),'','','Unlisted','47','157','No listed language support','158','47');
INSERT INTO Services VALUES('222','Feed Cheney','91','21','Active','Many of Cheney''s community safety net programs are not open after 5pm. Feed Cheney has evolved into a year-round free monthly scratch-made meal and community hub for volunteering.','Often on the last Monday of the month, 5:30 PM','','','Unlisted (likely must be enrolled in (or have a child enrolled in) Cheney School District)','48','158','No listed language support','159','48');
INSERT INTO Services VALUES('43','CORE Grant','13','22','Active','A CORE grant is a gift of financial support to qualifying food & beverage service employees with children. Every CORE grant is uniquely tailored to a grantee’s qualifying circumstances and financial need. Expenses that CORE grants cover include rent and mortgage, utilities, medical supplies, medical or therapy equipment, therapies, prescriptions, over-the-counter medication, medical travel expenses, funeral expenses, groceries, clothing, and other essential needs a family may need assistance with.',replace('Apply Online\n(https://core.submittable.com/login?login=1&returnUrl=%2Fsubmit%2F284871%2Fcore-2024-application)','\n',char(10)),'','',replace('1) Must be currently working in the food and beverage service industry and have worked in the food and beverage service industry for the past 90 days.\n2) Must have a legally dependent child under the age of 18 or a medically dependent child with documentation living within your home.\n3) Must have a qualifying circumstance within the last 90 days. Please note: Support from CORE is limited to one lifetime grant per family.\n\nFurther breakdown of eligibility can be found on the website.','\n',char(10)),'49','159','No listed language support','160','49');
INSERT INTO Services VALUES('44','Case Management','14','23','Active','Whether you are in need of housing assistance, supported employment, referrals to community resources, access to legal help, or information on applying for supplemental income, case management services are available to ensure your basic needs are met and to help you reach your goals.','Call for an appointment.','','checked','NONE','50','160','No listed language support','161','50');
INSERT INTO Services VALUES('45','Family Therapy','14','23','Active','Using evidence-based methods, family therapy can provide skills, knowledge, and the space to deal with hard things. We serve families of all sorts and sizes - helping you implement skills which will enhance relationship, manage behavior, build trust, process, understand, and take preventative measures.','Call for an appointment.','','checked','NONE','51','161','No listed language support','162','51');
INSERT INTO Services VALUES('46','Group Therapy','14','23','Active','For clients enrolled in individual therapy, we offer several group therapy opportunities including Mindfulness and Dialectal Behavioral Therapy skills. The Mindfulness group is a safe space to get support as you make positive life changes in our life, moving towards peace and gratitude. The Dialectical Behavioral Therapy (DBT) group teaches skills to improve one''s ability to cope with difficult emotions, have better relationships, and manage stress.','Call for an appointment.','','checked','NONE','52','162','No listed language support','163','52');
INSERT INTO Services VALUES('47','Individual Therapy','14','23','Active','Fully-licensed mental health therapists serve adults and teens with evidence-based practices. Each therapist works from a variety of treatment modalities including cognitive behavioral therapy, and interpersonal therapy, and we specialize in Dialectical Behavioral Therapy and Eye Movement Desensitization and Reprocessing Therapy (EMDR)','Call for an appointment.','','checked','NONE','53','163','No listed language support','164','53');
INSERT INTO Services VALUES('48','Peer Support','14','23','Active','Support is provided by peer counselors who have demonstrated their own mental health recovery and are committed to passing on what they have learned to others. Peer counselors provide hope that recovery is possible. That is done through activities directed by the client that affirm one''s strengths and self-worth. These activities might include learning new life skills, learning how to navigate mental health services, and learning how to advocate for oneself.','Call for an appointment.','','checked','NONE','54','164','No listed language support','165','54');
INSERT INTO Services VALUES('49','Affordable Computers','15','24','Active',replace('We do a strict need assessment, background and reference check, which helps us eliminate false requests and benefit those truly in need. If you or your nonprofit truly are in need and we are able to help, we will certainly contact you. Sometimes this can be weeks, so please be patient. We have a limited volunteer staff and strive to meet all application demands in a timely manner.\n\nAfter the application is submitted, we will review the information provided, then review our inventory, and if we are able to assist you then you will be contacted within 30 days. All applications are valid for 30 days, so if you do not hear from us within that time frame then you can apply again.','\n',char(10)),'Apply online.','','','Background check included in application.','55','165','No listed language support','166','55');
INSERT INTO Services VALUES('50','Settle In App & Website','16','25','Active',replace('Settle In digital platforms are available in multiple languages and provide videos, podcasts, and other resources on different topics about life in the United States.\n\nThe Settle In website has hundreds of resources including videos, podcasts, and fact sheets. Topics include cultural adjustment, employment, housing, U.S. laws, and more. Available in: Arabic, Burmese, Dari, English, Farsi, Kinyarwanda, Pashto, Russian, Somali, Spanish, Swahili, and Ukrainian. ','\n',char(10)),'Website and App are available at user''s discretion.','','','NONE','56','166','No listed language support','167','56');
INSERT INTO Services VALUES('282','Child Protective Services','17','26','Active',' CPS is responsible for the assessment, investigation, and intervention in cases of child abuse and neglect. Their primary focus is on protecting children and ensuring their safety and well-being.','Call during standard business hours.','','','Call for information.','57','167','No listed language support','168','57');
INSERT INTO Services VALUES('278','Family Reconciliation Services (FRS)','17','26','Active','Family Reconciliation Services (FRS) is a voluntary program serving runaway adolescents and youth who are in conflict with their families. The program targets adolescents between the ages of 12 through 17. FRS services are meant to resolve crisis situations and prevent unnecessary out-of-home placement. They are not long-term services. The services will assess and stabilize the family''s situation. The goal is to return the family to a pre-crisis state and to work with the family to identify alternative methods of handling similar conflicts. If longer-term service needs are identified, FRS will help facilitate getting the youth and their family into ongoing services.','Call during standard business hours.','','','Call for more information.','58','168','No listed language support','169','58');
INSERT INTO Services VALUES('279','Foster Youth Services','17','26','Active','Help foster youth with employment, create resumes, housing, budgeting, education, health services, and providing support for LGBTQIA+ youth.','Call during standard business hours.','','','Call for information.','59','169','No listed language support','170','59');
INSERT INTO Services VALUES('280','Juvenile Rehabilitation','17','26','Active',replace('DCYF''s Juvenile Rehabilitation (JR) serves Washington state''s highest-risk young people, who are convicted of crimes that reflect the profound violence, neglect, trauma, addiction, and other challenges they faced before they ever reached our doors.\n\nThe goal of JR is to deliver treatment, provide resources, and develop skills so young people can plan for their future and reenter their communities','\n',char(10)),'Call during standard business hours.','','','JR serves youth up to 25 years old who are committed to juvenile custody by a court.','60','170','No listed language support','171','60');
INSERT INTO Services VALUES('276','Working Connections Child Care (WCCC)','17','26','Active','Working Connections Child Care (WCCC) helps eligible families pay for child care. When a family qualifies for child care subsidy benefits and chooses an eligible provider, the state pays a portion of the cost of child care. Parents may be responsible for a copayment to their provider each month.','Call during standard business hours.','','',replace('''- The child must reside in Washington.\n- The family with whom the child resides must live in Washington state.\n- The family''s income must be at or below 60% of the State Median Income (SMI) at application or 65% of SMI when reapplying.\n- The family must have resources under $1 million.','\n',char(10)),'61','171','Access to phone interpreters | ALL LANGUAGES','172','61');
INSERT INTO Services VALUES('52','Food Assistance Program (FAP)','18','27','Active','','Call during standard business hours.','','','','62','172','Access to all kinds of interpreters | ALL LANGUAGES','173','62');
INSERT INTO Services VALUES('53','Temporary Assistance for Needy Families (TANF)','18','27','Active','Temporary Assistance for Needy Families provides temporary cash for families in need. Some families participate in the WorkFirst Program. The WorkFirst Program helps participants find and keep jobs.','Call during standard business hours.','','',replace('''- Income and resource requirements: Total resource value of under $12,000.\n- Citizenship and alien status requirements\n(More information available on website)','\n',char(10)),'63','173','Access to all kinds of interpreters | ALL LANGUAGES','174','63');
INSERT INTO Services VALUES('221','Food Pantry','90','28','Active','If you are in need, please come to our food pantry to get food for yourself or for your family. We love having volunteers, anyone is welcome to come and help us.  Email us at eastvalleybaptist@gmail.com for any questions or help.','4th Saturday of every month, 10 AM - 12 PM','','','Unlisted','64','174','No listed language support','175','64');
