INSERT INTO Services VALUES('55','Breaking Bread (Food Pantry)','19','29','Active','Jesus has asked that we love our neighbors, and this is an opportunity to show that love. Whether in need or wishing to simply come help Breaking Bread Ministry is a wonderful place to connect, serve and receive the love of Christ.','Tuesdays, 9am-11am','','','NONE','66','176','No listed language support','177','66');
