INSERT INTO Services VALUES('58','Celebrate Recovery','19','29','Active','Large and small groups and dinner.',replace('Wednesday, 7:00pm-8:00pm\nFriday, 5:30pm-9:00pm','\n',char(10)),'','','NONE','69','179','No listed language support','180','69');
INSERT INTO Services VALUES('59','Narcotics Anonymous','19','29','Active','Christ center Nar-Anon 12-step for those effected by the addict.','Mondays, 6pm-7pm ','','','NONE','70','180','No listed language support','181','70');
INSERT INTO Services VALUES('60','Emergency Shelter','20','30','Waitlist Only','Families are assessed at the Family Promise Center and space is available, we move a family to a Neighborhood Site where they can take showers, receive case management, and look for housing and jobs, all in a family-friendly setting. With volunteers giving their time, making meals, and sharing hospitality, family homelessness is addressed without the creation of expensive shelters.','24hrs a day','','','','71','181','No listed language support','182','71');
INSERT INTO Services VALUES('61','Landlord Engagement Program','20','30','Active','There are many community-minded landlords who want to make a difference for vulnerable families, but have valid concerns about their properties and businesses. The Landlord Engagement Program is the solution. Through a formal partnership with Family Promise, landlords receive tiered benefits depending on their agreement, ensuring that landlords secure the needed support to fulfill their desire to help vulnerable families.','Call during standard business hours.','','','Must be enrolled in Family Promise case management.','72','182','No listed language support','183','72');
INSERT INTO Services VALUES('62','Rental Assistance / Case Management','20','30','Active','Preventing families from becoming homeless through rental assistance and targeted case-management is essential to what we do.','Call during standard business hours.','','','','73','183','No listed language support','184','73');
INSERT INTO Services VALUES('283','Stabilization Program','20','31','Active','Family Promise of Spokane works with newly or unstably housed families for up to two years, providing ongoing life skills training, mentorship, and personalized case management aimed at equipping the family toward long-term self-sufficiency. ','Call during business hours.','','','','74','184','No listed language support','185','74');
INSERT INTO Services VALUES('63','Brain Cancer Grant','21','32','Temporary Closure',replace('Assists patients and caregivers facing financial hardship as a result of a brain cancer diagnosis.\n\nThe grant cap for this fund is $1,000. This can be paid as a direct check, toward eligible bills, or a combination of the two.','\n',char(10)),'Apply Online','','',replace('''- Brain cancer diagnosis\n- Currently in active treatment in the US or US territory\n- Healthcare professional who can confirm where the patient is receiving treatment.\n- Federal Poverty Level (FPL) of 300% or less','\n',char(10)),'75','185','No listed language support','186','75');
