INSERT INTO Services VALUES('65','Cervical Cancer Grant','21','32','Temporary Closure','Assists patients and caregivers facing financial hardship as a result of a cervical cancer diagnosis.','Apply Online','','',replace('''- Cervical cancer diagnosis\n- Currently in active treatment in the US or US territory.\n- Must be a healthcare professional who can confirm where the patient is receiving treatment\n- Federal Poverty Level (FPL) of 300% or less','\n',char(10)),'77','187','No listed language support','188','77');
INSERT INTO Services VALUES('66','Clinical Trial Access Grant','21','32','Active',replace('Assists patients and caregivers facing financial hardship as a result of participation in a clinical trial for a cancer diagnosis.\n\nThe maximum grant amount for this fund is $3,200. A Family Reach Navigator will work with you to determine the best grant amount based on the household’s specific needs.','\n',char(10)),'Apply Online','','',replace('''- Participation in a clinical trial based in the US or a US territory that is intended to actively treat a cancer diagnosis\n- Expected household income for this year is within 300% of the Federal Poverty Level (FPL)\n- Application must be submitted by a member of the healthcare team where the patient is receiving treatment','\n',char(10)),'78','188','No listed language support','189','78');
INSERT INTO Services VALUES('67','General Funding Grant','21','32','Temporary Closure','Assists patients and caregivers facing financial hardship as a result of a cancer diagnosis.','Apply Online','','',replace('''- Currently in active treatment in the US or US territory.\n- Healthcare professional who can confirm where the patient is receiving treatment.\n- Federal Poverty Level (FPL) of 300% or less','\n',char(10)),'79','189','No listed language support','190','79');
INSERT INTO Services VALUES('68','Multiple Myeloma Grant','21','32','Temporary Closure',replace('Assists patients and caregivers facing financial hardship as a result of a multiple myeloma diagnosis.\n\nThe grant cap for this fund is $1,000. This can be paid as a direct check, toward eligible bills, or a combination of the two.','\n',char(10)),'Apply Online','','',replace('''- Multiple myeloma cancer diagnosis\n- Currently in active treatment in the US or US territory\n- Must be a healthcare professional who can confirm where the patient is receiving treatment\n- Federal Poverty Level (FPL) of 300% or less','\n',char(10)),'80','190','No listed language support','191','80');
INSERT INTO Services VALUES('69','Pediatric Grant','21','32','Temporary Closure','Assists pediatric patients and their caregivers facing financial hardship as a result of a cancer diagnosis.','Apply Online','','',replace('''- Currently in active treatment in the US or US territory.\n- Healthcare professional who can confirm where the patient is receiving treatment.\n- Federal Poverty Level (FPL) of 300% or less\n- Pediatric diagnosis of someone 18 years or younger','\n',char(10)),'81','191','No listed language support','192','81');
INSERT INTO Services VALUES('253','Registration Assistance','105','33','Active',replace('FROC can assist with registration in the following ways:\n\n* Register all school-aged children in a family at one location.\n* Determine which school each child will attend.\n* Arrange transportation for students if needed.\n* Provide interpreter services in the family’s primary language.\n* Provide orientation on district policies, including basic translated information.\n* Complete WIDA Screener assessment and secondary placement testing\n* Introduce the family to the ELD program and its services.\n* Notify the receiving school that children are ready for placement and provide an orientation meeting at the school site.\n* Prepare registration packet for receiving schools and family.\n\n\n**What do I need to bring with me to register?**\n\n1. **Documentation of student age** (e.g., a birth certificate, foreign birth certificate, passport, adoption record, previously verified school records, or any other documents permitted by law) is required for students who have not previously enrolled in school. Kindergarten students must be 5 on or before Aug. 31, first graders must be 6.\n2. **Proof of residency**. This can be a current driver''s license or ID, or a current utility bill.\n3. **Registration forms**. These are available at the school, or you can [download the entire registration packet here](https://5il.co/2bmvk). (or see attached)','\n',char(10)),'Please call to make an appointment','','checked','Must be an immigrant or refugee whose first language is not English and who does not speak English at home.','82','192','Access to all kinds of interpreters | ALL LANGUAGES','193','82');
INSERT INTO Services VALUES('70','Barton English Language School','22','34','Active','The Barton School is a non-profit organization comprised of educational professionals and experienced volunteers who are dedicated to walking through the language learning process with students. Their teachers use a variety of instructional approaches to match the diverse needs of language learners. They primarily focus on teaching English that adult students will encounter during their daily lives. Childcare is available onsite for ages 0-5 years old for any individual who is taking classes.','Mondays / Wednesdays / Fridays, 9 AM - 11:30 AM','','','NONE','83','193','No listed language support','194','83');
INSERT INTO Services VALUES('71','Bail Assistance','23','35','Active','For bails under $500 only.','Apply Online','','','Defined on form','84','194','No listed language support','195','84');
INSERT INTO Services VALUES('72','Housing Assistance','23','35','Active','We offer swift housing with a turnaround time of 48 hours to homeless individuals seeking immediate shelter.','Call during regular business hours','','','Defined on contact','85','195','No listed language support','196','85');
INSERT INTO Services VALUES('73','Social Security Assistance','23','35','Active','We navigate disabled individuals through the complex processes and required paperwork, assisting them in receiving Social Security and SSI benefits.','Call during regular business hours','','','Defined on contact','86','196','No listed language support','197','86');
INSERT INTO Services VALUES('74','Garland Little Food Pantry','24','36','Active','The Wednesday Evening Community Journey Group stocks the Little Food Pantry on the East lawn of the church (by the Post Office). With the high level of food insecurity in our neighborhood, our pantry is one of the busiest in the city.','Call during standard business hours.','','','Anyone in need is free to take food, notes of encouragement or a New Testament from the Food Pantry.','87','197','No listed language support','198','87');
INSERT INTO Services VALUES('75','The Garland House','24','37','Active','The Sunday Morning Journey Group oversees the care and upkeep of the Garland House owned by Garland Church and operated in partnership with World Relief.  Newly arrived refugees are welcome to stay for up to 60 days before moving to their permanent home. Residents pay $250 per week.','Call during standard business hours.','','','Call for information.','88','198','No listed language support','199','88');
INSERT INTO Services VALUES('76','English Language Program','25','38','Active',replace('Global Neighborhood offers free English classes for any refugee in the community. Classes focus on practical language skills and development serving language learnings level 1-6. \n\nOur language program seeks to empower students to successfully navigate life and work in the U.S. as well as identify and prioritize their personal, educational, and workplace goals. Refugees with higher English proficiency are more likely to secure employment in skilled occupations and earn higher salaries. Therefore, by increasing English language proficiency, Global Neighborhood directly enhances the earning potential of our refugee participants.','\n',char(10)),'Enroll for class times.','','','Must be a refugee.','89','199','No listed language support','200','89');
INSERT INTO Services VALUES('77','Job Readiness Program','25','38','Active',replace('Regardless of prior work experience or fluency in English, any former refugee who has relocated to Spokane can be connected to workplace training through Global Neighborhood''s Job Readiness Program.\n\nAcquiring the necessary job skills is the first step toward a fulfilling, self-sustaining new life in the U.S. We aim to ensure that every former refugee in Spokane who wants a job can find one. Refugees face several barriers to employment, including language and cultural barriers, difficulties navigating new systems, and no local references. The Job Readiness Program provides the necessary training, work experience, familiarity with a new language and culture, and local employment references for refugees experiencing barriers to employment.','\n',char(10)),'Call during regular business hours.','','','Must be a refugee.','90','200','No listed language support','201','90');
INSERT INTO Services VALUES('78','Basic Food Assistance Program','26','39','Active','We can help you apply for Basic Food Assistance (EBT cards) and assist with your annual review.','Call for an appointment.','','checked','NONE','91','201','No listed language support','202','91');
INSERT INTO Services VALUES('79','Clothing Bank','26','39','Active','Our clothing bank distributes donated clothing, shoes, blankets, coats and limited household items monthly.',replace('Mondays, 2 PM - 5:45 PM\nWednesdays & Fridays, 1 PM - 3:45 PM','\n',char(10)),'','','NONE','92','202','No listed language support','203','92');
INSERT INTO Services VALUES('80','Food Bank','26','39','Active','Residents of Deer Park and Clayton can shop for non-perishable food once a month. They can also shop for bread and produce weekly. Residents of neighboring small towns may shop for bread and produce weekly.',replace('Mondays, 2 PM - 5:45 PM\nWednesdays & Fridays, 1 PM - 3:45 PM','\n',char(10)),'','','NONE','93','203','No listed language support','204','93');
INSERT INTO Services VALUES('81','Personal Hygiene','26','39','Active','We distribute soap, shaving cream, feminine hygiene items, shampoo, toothpaste, toothbrushes, deodorant, makeup, diapers and wipes and other items as available.',replace('Mondays, 2 PM - 5:45 PM\nWednesdays & Fridays, 1 PM - 3:45 PM','\n',char(10)),'','','NONE','94','204','No listed language support','205','94');
INSERT INTO Services VALUES('82','Supplemental Food for Senior Adults','26','39','Active','Sometimes called Senior Boxes, Commodity Supplemental Food boxes are available for adults 60 or older who qualify by income. Call or visit us to see if you qualify.','Call for an appointment','','','Call or visit us to see if you qualify','95','205','No listed language support','206','95');
INSERT INTO Services VALUES('83','Utility Assistance','26','39','Active','Once per year we will provide assistance for Avista utility payments. Also once per year, we can provide limited assistance for Inland Power, City of Deer Park water, or other non-conventional utility needs.','Once per year. Call for an appointment','','checked','Call or visit us to see if you qualify','96','206','No listed language support','207','96');
INSERT INTO Services VALUES('204','Homeownership Program','82','40','Waitlist Only',replace('Phone number with extension: (509) 534-2552 x221\n\nHabitat for Humanity-Spokane partners with individuals and families in need of a safe affordable place to call home.\n\nWe believe that home is the beginning of a strong foundation. A Habitat home helps families develop a stable financial future, and a healthy place for a family and children to grow and thrive.\n\nHabitat homeowners are active participants in building a better future for themselves and their families. They get a hand up, *not* a handout. They complete hundreds of hours of sweat equity building their own home and homes of other Habitat families, attend financial workshops and homebuyer classes, save for their closing costs and pay an affordable mortgage. It’s hard work but it’s worth it.\n\nHabitat homeowners achieve strength, stability and self-reliance through shelter. Shelter they helped build.','\n',char(10)),'By appointment only. Call during business hours to schedule an appointment.','','checked',replace('* An applicant’s household gross income must be less than 80% of Spokane County’s median income based on family size. (Chart visible on website)\n* Prospective Habitat homeowners must demonstrate a need for safe and affordable housing, be able to pay an affordable mortgage, and be willing to partner with Habitat.','\n',char(10)),'97','207','No listed language support','208','97');
INSERT INTO Services VALUES('205','The Habitat Store','82','40','Active','The Habitat Store is a nonprofit, home-improvement store that sells new and gently used donated furniture, appliances, home accessories, building materials and more to the public at a fraction of the retail price.',replace('Tuesday - Saturday, 9 AM - 5 PM\n(Closed Sunday - Monday)','\n',char(10)),'','','NONE','98','208','No listed language support','209','98');
INSERT INTO Services VALUES('84','Diversion','27','41','Active',replace('Diversion helps families identify housing options outside the formal homeless response system.\n\nDiversion provides “light touch” case management that helps families to identify solutions to their housing crisis. Through problem solving conversations Diversion collaborates with households to help them avoid or resolve homelessness. At Homeless Resources, every household has the opportunity to partner with a Diversion specialist to review their housing situation and create a plan to overcome their housing challenge. Our Diversion Specialists are able to work with families for up to 30 days.\n\nWhile we do not have financial assistance for direct housing costs such as rental arrears or security deposits, staff can assist with mediating a dispute with a landlord, relative or friend that can provide housing or in some cases provide limited flexible funding to support transportation or job-related expenses to help a family maintain the income needed to move into housing.','\n',char(10)),'Monday - Thursday, 8 AM - 3 PM','','','Must be at risk of homelessness.','99','209','No listed language support','210','99');
INSERT INTO Services VALUES('85','Homeless Family Coordinated Assessment (HFCA)','27','41','Active',replace('Families experiencing housing instability can be pre-screened for HFCA by filling out a secure online application located here: https://hfca.cceasternwa.org/\n\nMany agencies and programs are available to help families* that are experiencing homelessness, so when families face an unstable housing situation it can be difficult for them to know where to go.\n\nHFCA provides families with a centralized point of entry to access housing resources. Through HFCA, families meet with a Coordinated Entry Specialist who first utilizes Diversion strategies to determine if a family’s housing crisis can be resolved outside of the formalized homeless response system. If Diversion is not a good fit to meet the household’s needs a vulnerability assessment is used to pre-screen their eligibility for services. Once screened the family is placed in a priority pool. When a vacancy becomes available households in the pool are connected directly to the housing resource.\n\nHFCA does not provide families with immediate housing; instead, HFCA guides families in Spokane County toward homeless housing resources. Because homeless housing resources are limited, there is no guarantee of housing through HFCA. Households are prioritized based on their barriers and vulnerabilities.  \n\n* Families include one or more parent/guardian with kids in custody, at least 51% of the time, or that are currently pregnant. Homeless individuals and couples without children can get help through the Singles Homeless Coordinated Assessment operated by SNAP.','\n',char(10)),'Apply online.','','','Application provides eligibility.','100','210','No listed language support','211','100');
INSERT INTO Services VALUES('86','Rapid Rehousing','27','15','Active',replace('Many households experiencing homelessness need to access additional financial resources to move into a new housing unit.\n\nAfter completing pre-screening by HFCA, households experiencing homelessness or living in a shelter may be referred to the Rapid Rehousing program. Through Rapid Rehousing, households can access short-term financial support and case management services that help them get into private apartments and public housing.\n\nIn this family-centered program, households conduct their own housing search. If households request it, Catholic Charities assists them with identifying housing vacancies, completing applications, writing letters of appeal and answering questions about the lease-signing process.\n\nHouseholds receive assistance with move-in costs, such as application fees and security deposits. Catholic Charities ensures the unit passes quality standards before paying the landlord. Our landlord liaison identifies landlords willing to partner with Rapid Rehousing tenants and addresses with the landlord any concerns households have while living in their apartments.','\n',char(10)),'Fluctuates with needs of client. Enroll for specific times.','','','Pre-screening defines eligibility.','101','211','No listed language support','212','101');
INSERT INTO Services VALUES('87','Daily Services','28','42','Active',replace('Daily services that support the body, mind and spirit of our clients include: \nCase management and peer support, barber services, White Bison meetings, movie and bingo events, garden and music club.\n- Breakfast and Lunch and Dinner served daily to those who slept the night before\n- Showers and the Resource Room with select personal care items available are open daily\n- SSI/SSDI attorney available Thursdays 9:00-12:00pm','\n',char(10)),'Monday - Friday, 8:30 AM - 4:30 PM','','','NONE','102','212','No listed language support','213','102');
INSERT INTO Services VALUES('88','Men''s Sleeping Program','28','42','Active',replace('Since 1979, the Men''s Sleeping Program has allowed men from all walks of life in the Spokane Area to take refuge in a bed rather than being out on the streets at night.\n- Clients can start checking in at 5:00 pm but no later than 8:00 pm\n- Anyone that slept the night before can remain on-site for the full day','\n',char(10)),'Check-in is 5 PM, check-in closes at 8 PM','','','NONE','103','213','No listed language support','214','103');
INSERT INTO Services VALUES('89','Providence House of Charity Medical Clinic','28','90','Active','The Medical Clinic was founded in 1976 as an outreach of Sacred Heart Medical Center and once found its home in small quarters at the HOC. In 2017, the clinic moved into a new facility just one block from the shelter. It offers longer hours and now has the capacity to care for more unserved patients than ever before.','Monday - Friday, 8:30 AM - 4:30 PM','','','NONE','104','214','No listed language support','215','104');
INSERT INTO Services VALUES('90','Residential Client Program','28','42','Active',replace('Our RC Program is a client volunteer, workforce development program that aims to advance education and training while developing a healthy community.\n- Clients work 20 hours a week in exchange for room and board.\n- Goal: Participants gain the experience and tools they can use to find employment.\n- Case management and Worksource classes are provided to all RC clients.','\n',char(10)),'Individualized per client. Inquire for specifics.','','','NONE','105','215','No listed language support','216','105');
INSERT INTO Services VALUES('91','Transitional Respite Program','28','42','Active',replace('One of the best medicines for people recovering from illness or injury is the ability to rest in a safe and comfortable environment. Respite at HOC is a nationally recognized program in partnership with Providence Healthcare and the 2016 winner of The Catholic Health Association of the United States "Achievement Citation Award - For innovative programming that changes lives"\n- Clients are provided with a place to recuperate\n- Referred by Providence and other local hospitals and clinics\n- Case management services provided to all Respite clients and work to build each person’s social determinants of health while working towards permanent housing.','\n',char(10)),'Call during regular business hours.','','','NONE','106','216','No listed language support','217','106');
INSERT INTO Services VALUES('92','Attachment Vitamins','29','25','Active','This program is designed to assist caregivers in understanding early childhood development. The primary goal of AV is to provide caregivers with knowledge about early childhood development, toxic stress, and trauma, enabling them to better understand and respond to their child’s needs. Additionally, the program aims to help caregivers set parenting goals, strengthen the parent-child relationship, and manage challenging behaviors.','Call during regular business hours','','',replace('- Living in the U.S. 5 years or less.\n- Parents or caregivers of children aged from 0 to 5 years.','\n',char(10)),'107','217','No listed language support','218','107');
INSERT INTO Services VALUES('93','Extended Case Management - PRIME','29','25','Active','The PRIME extended case management program serves clients who are out of their resettlement period and are struggling with multiple challenges and need ongoing case management to achieve self-sufficiency. Case manager will conduct an intake to ensure that the client qualifies and then collaboratively develop a comprehensive service plan that outlines realistic goals. Case manager will link participants in need of services or benefits to local resources. Some services that have been provided in the past include eviction mitigation, connection to rental/utility/transportation assistance, connection to health programs or health care providers, connection to childcare providers, connection to legal assistance related to family law, and coaching on how to navigate housing. There is no financial support directly available from PRIME services.  ','Call during regular business hours for an appointment.','','',replace('- Must be age 16+ \n- Resided in US for 5 years or less  \n- Not eligible in their first 90 days  \n- Not enrolled in R&P, MG, PC, or other funded case management services ','\n',char(10)),'108','218','No listed language support','219','108');
INSERT INTO Services VALUES('94','Financial Stress Management','29','25','Active','This program provides an in-depth understanding of the basics of the U.S. financial system, various types of financial stress, their impacts on health, and strategies for building healthy credit and managing day-to-day financial stress. Participants will be able to learn the basic knowledge of different types of financial stressors, and their impact on their activities, learn the basics of budgeting, credit management strategies, etc.','Call during regular business hours','','',replace('- Afghan and Ukrainian\n- +15 age\n- Living in the U.S. less than 5 years\n- Persons under Diversity Visas are not eligible','\n',char(10)),'109','219','No listed language support','220','109');
INSERT INTO Services VALUES('95','Harassment Stress Management','29','25','Temporary Closure',replace('These sessions aim to boost confidence, improve community mobility, and enhance a sense of safety during our clients’ daily commutes, addressing immediate stress concerns. \n\nA key focus is introducing participants to local health and safety services, aiding their transition into the community. This strategic approach ensures individuals are well-informed and connected to essential resources, facilitating a smoother integration process.','\n',char(10)),'Call during regular business hours','','','Info coming soon.','110','220','No listed language support','221','110');
INSERT INTO Services VALUES('96','Intensive Case Management - PC','29','25','Active',replace('The Preferred Communities (PC) Intensive Case Management (ICM) program serves clients identified as highly vulnerable/ at-risk and who require more than six months of ongoing intensive services. Individuals are enrolled into ICM, not households or families, and serve as active partners throughout the service period. This allows for tailored case management that focuses on individual needs, creating sustainable action items to address barriers and identified vulnerabilities. \n\nAs with other case management programs, the goal of ICM is self-sufficiency.','\n',char(10)),'Call during regular business hours for an appointment.','','',replace('- In the U.S. 5 years or less\n- Not receiving duplicated services from other programs\n- Can serve secondary migrants, asylees, and individuals resettled by other agencies if otherwise eligible','\n',char(10)),'111','221','No listed language support','222','111');
INSERT INTO Services VALUES('97','Mental Health Interventions','29','25','Active',replace('We serve clients who may be experiencing mental health concerns including but not limited to behavioral health issues, suicide ideation, and substance use disorders. We can also provide interventions for clients undergoing safety concerns like abuse, harassment, neglect, exploitation, and other issues related to interpersonal violence.  \n\nWe will assess, respond, provide interventions and follow-up care for clients of concern as needed.','\n',char(10)),'Call during regular business hours','','',replace('''- 16+ years of age, minors will need consent from a legal guardian.\n- Arrived with status of; Refugee, Asylee (granted), SIV, Amerasian, Humanitarian Parolee (Afghan or Ukrainian arrival prior to 1/1/2023), Cuban/Haitian entrants, as well as T and U visa holders (some exceptions).\n- Participants must have been in the US for less than 5 years and not yet be a US Citizen.\n- Diversity visa holders are not eligible.','\n',char(10)),'112','222','No listed language support','223','112');
INSERT INTO Services VALUES('98','Pathways to Wellness','29','25','Active','This ten-week course aimed at helping individuals understand the fundamentals of culture and cultural adaptation, and to enhance their ability to integrate into a new culture in a healthy manner. The program supports the emotional well-being of refugees by promoting adjustment, self-sufficiency, and community connections.','Call during regular business hours','','',replace('- +15 age\n- Living in the U.S. less than 5 years\n- Persons under Diversity Visas are not eligible','\n',char(10)),'113','223','No listed language support','224','113');
INSERT INTO Services VALUES('99','Short-Term Case Management - PRIME','29','25','Active',replace('This short-term service is for clients facing small challenges in their journey to achieve self-sufficiency. These services are provided on a drop-in basis and do not include the same level of follow up as a long-term case management enrollment would.\n\nWhen a client drops in, a case manager will conduct an intake to ensure that the client qualifies and then collaboratively develop a comprehensive service plan that outlines realistic goals. Case manager will link participants in need of services or benefits to local resources.\n\nThere is no financial support directly available from PRIME services. Different from the long-term prime case management, short term prime case management is designed for clients who need help short term and not on-going long-term case management which works closely with each step of clients’ progress. Clients who initially get short-term services can transfer to long-term prime case management if needs.\n\nExamples of services provided through Short-term CM:  \n- Eviction Mitigation\n- Connection to rental/utility/transportation assistance\n- Connection to health programs or health care providers\n- Assistance finding childcare providers\n- Informal referral to legal assistances related to family law\n- Coaching on how to navigate housing','\n',char(10)),'Call during regular business hours for an appointment.','','',replace('- Must be age 16+ \n- Resided in US for 5 years or less  \n- Not eligible in their first 90 days  \n- Not enrolled in R&P, MG, PC, or other funded case management services ','\n',char(10)),'114','224','No listed language support','225','114');
INSERT INTO Services VALUES('100','Conversation Sessions','30','44','Active','Practice English one-to-one with American women who want to meet you and talk about real-life topics like family, food and friendship! All sessions are held online using Zoom.',replace('Rolling service times with the season, confirm availability online.\nMay 2, 9, 16 - Thursdays, 7 PM - 8 PM (Central Time)\nMay 3, 10, 17 - Fridays 10:30 AM - 12 PM (Central Time)','\n',char(10)),'','','Must be a woman.','115','225','No listed language support','226','115');
INSERT INTO Services VALUES('101','Pronunciation Classes','30','44','Temporary Closure','Classes are taught by volunteer Speech Language Pathologists: Gail Totten, Kate Anderson, and Viki Schmidt. The purpose of each class is to help Learners speak English more clearly and naturally so they can communicate effectively with native English speakers. All classes are held online via Zoom.','Rolling service times with the season, confirm availability online.','','',replace('- Must be a woman.\n- New Learners need to have attended at least 5 Conversation Sessions with Ladies Let’s Talk.\n- New Learners also need to be Intermediate-Advanced English speakers. Learners with this level of English will benefit the most from our classes.','\n',char(10)),'116','226','No listed language support','227','116');
INSERT INTO Services VALUES('102','Immigration & Legal Aid','31','45','Active','Manzanita Immigrant Legal Aid works with and for the immigrant community in Spokane to build stability and strength by providing low-cost, accessible legal services. We believe that legal aid, education, and community empowerment make Spokane a better place for all--a place where everyone has a chance to be welcomed and celebrated','Call during standard business hours.','','','Service Dependant.','117','227','No listed language support','228','117');
INSERT INTO Services VALUES('210','Mead Food Bank','84','46','Active','We provide assistance to families and individuals living within the boundaries of the Mead School District and all of Washington State.',replace('Wednesdays, 4 PM - 6:45 PM\nSundays, 4 PM - 5 PM (bread / produce only)','\n',char(10)),'','','Must reside within the boundaries of Mead School District','118','228','No listed language support','229','118');
INSERT INTO Services VALUES('103','Non-Emergency Long Distance Medical Transportation','32','47','Active','Patients are provided with gas cards, or commercial bus or Amtrak tickets to medical-related treatment. These trips are for non-local medical care more than 50 miles away. Gas cards are also available for multiple trips to local treatment.','Apply online.','','',replace('''- Must be traveling at least 50 miles from home to treatment facility.\n- Applicants must apply 21 days before their flight/appointment date.\n- Proof of Income: Family income; First page of your most recent Federal tax return, social security, Medicaid or disability statement.\n- Verification of your medical appointment (a letter from your physician, a printed appointment reminder, or a screen shot of your patient portal showing the appointment date).','\n',char(10)),'119','229','No listed language support','230','119');
INSERT INTO Services VALUES('104','Non-Emergency Medical Flights','32','47','Active','Mercy Medical Angels provides charitable, need-based commercial airline assistance for patients and one medically-necessary escort.','Apply online.','','',replace('''- Minimum of 21 days'' notice before your travel date to consider flight assistance.\n- Completed medical clearance form from the doctor who has recently physically seen the patient and knows they are going to this appointment. Our medical clearance form will be faxed to the doctor after we receive your application.\n- Income verification which includes total household income and assets for everyone living in the household. Forms of verification include current year complete income tax return and current award letters from Disability and SSI (if applicable).\n- Mercy Medical Angels may sponsor a round-trip for a patient and one non-medical attendant (if the doctor finds it medically necessary) on a commercial flight, coach seating.\n\nThe patient must:\n- Be able to sit on their own once they are in the seat.\n- Require little or no medical attention.\n- Be able to transfer out of their wheelchair into their seat on the aircraft with little or no assistance (they cannot have someone literally pick them up and sit them in the seat).\n- If the patient requires oxygen, some airlines may provide it during the flight. Otherwise, the patient must have a portable oxygen concentrator (POC) approved by the FAA or the airlines. Commercial airlines require no less than 48 hours advance notice to prepare for the equipment needed. The patient is responsible for making these arrangements and paying any travel fees associated with the oxygen.\n- An income-based, minimal, nonrefundable airline ticket processing fee will be determined upon verification of all required income documentation.','\n',char(10)),'120','230','No listed language support','231','120');
INSERT INTO Services VALUES('245','Mid-City Concerns Senior Center Meals','101','48','Active','The Mid-City Senior Center continues to provide hot lunch meals 5 days a week to Senior Center members 60 years of age and older. The suggested donation is $5.00 per hot lunch, or $25 membership paid up front for the year. Lunch is served at 11:30 A.M.','Monday - Friday, 11:30 AM','','','Must be a senior center member and 60+ years old','121','231','No listed language support','232','121');
INSERT INTO Services VALUES('105','Dr. Martin Luther King Jr. Food Bank','33','49','Active','Here at the Dr. Martin Luther King Jr. Food Bank, we strive to answer Dr. King Jr. by serving our community to ensure that no one goes hungry.   Clients can visit our Food Bank once a week.  Please have space in your trunk or flatbed for the pre-boxed food, if driving.','Mondays / Wednesdays / Fridays,  1 PM - 3 PM','','','Proof of residency, government issued photo ID, ID for everyone in the household - including children.','122','232','No listed language support','233','122');
INSERT INTO Services VALUES('106','Early Childhood Education and Assistance Program (ECEAP)','33','49','Active','The Early Childhood Education and Assistance Program (ECEAP) is a free preschool program for eligible children and their families. ECEAP focuses on the well-being of the whole child by providing nutrition, health, education, and family support services. The goal of ECEAP is to help all children enter kindergarten ready to succeed.','Call during standard business hours.','','','Children 3 years and older or 4 years old by August 31 are accepted into ECEAP based on the following: From a family with an annual income at or below 110 percent of the federal poverty level','123','233','No listed language support','234','123');
INSERT INTO Services VALUES('107','Fulfilment, Achievement, Maturity, Enrichment Program (FAME)','33','49','Active','FAME is an after-school program for children K-6 grade who attend Grant, Sheridan or Franklin elementary schools. FAME provides: Homework Assistance- to help improve academic performance, Health and Nutrition- USDA approved snacks are provided, Best Practices- additional curriculums that teach the essential social skills such as problem-solving, emotional management, impulse control, and empathy, Enrichment Activities- ability to participate in non-academic programs (i.e.) field trips, gardening, dance classes, cooking classes, and art classes.','Call during standard business hours.','','','Must attend either Grant, Sheridan, or Franklin Elementary Schools.','124','234','No listed language support','235','124');
INSERT INTO Services VALUES('108','Senior Commodity Supplemental Food Program (CSFP)','33','49','Active','Senior Commodity Supplemental Food Program (CSFP) sponsored by 2nd Harvest, provides additional food once a month to seniors. In order to qualify for the CSFP Program one must be 60 years of age or older and have a household gross income of less than 130% of the Federal Poverty Guideline.  Inquire when you arrive at the Food Bank. Or call the center at 509-868-0856 and the Intake Coordinator will be able to assist you.','Mondays / Wednesdays / Fridays,  1 PM - 3 PM','','','Proof of residency, government issued photo ID, and must be 60 years of age or older and have a household gross income of less than 130% of the Federal Poverty Guideline.','125','235','No listed language support','236','125');
INSERT INTO Services VALUES('109','Senior Programs','33','49','Active','Provides emotional, social, physical and educational activities focused around the needs of older adults. We provide a welcoming, inclusive environment where seniors can enjoy warm friendships, healthy activities, joyful experiences, and meaningful engagement as they age.','Call during standard business hours.','','','Must be at least 60 years old.','126','236','No listed language support','237','126');
INSERT INTO Services VALUES('110','Summer Youth Academy (SYA)','33','49','Active','SYA is a structured 8-10-week summer program designed to serve youth between the ages of 3-12. SYA provides an interactive learning environment designed to build self-esteem and promote diversity and cultural awareness. The program offers recreational activities and community service opportunities.','Call during standard business hours.','','','Must be within the ages of 3 to 12 years old.','127','237','No listed language support','238','127');
INSERT INTO Services VALUES('111','Teen Tech Center','33','49','Active',replace('The U.S. is facing a rapidly rising shortage of people qualified for tech-reliant jobs. By 2020, 1.4\nmillion jobs (77% of all jobs in the country) will require tech skills and only 400,000 people will\nbe trained for them. Teens from underserved communities are especially at-risk because they\nlack the tech, training and mentoring to help them prep for careers.\nThe Teen Tech Center is equipped with technology and multimedia tools that can be used for\nvideo production, graphic design, coding and much more.','\n',char(10)),'Call during standard business hours.','','','Must be a teenager.','128','238','No listed language support','239','128');
INSERT INTO Services VALUES('243','Self-Sufficiency Grant','98','50','Active',replace('**Modest Needs'' hallmark grant is our Self-Sufficiency Grant. We make Self-Sufficiency Grants in an effort to assist individuals and families who, because they are working and live just above the poverty level, are ineligible for most types of conventional social assistance but who, all the same, are living one or two lost paychecks away from the kind of financial catastrophe that eventually leads to homelessness. **\nWe give special consideration to persons living alone (single persons with no dependent children), public school teachers, and first responders - the people who do the most for our communities but who don''t generally qualify to receive assistance from conventional agencies, even though these good folks are often grossly undercompensated for their work.\nGenerally, Modest Needs offers Self-Sufficiency Grants to qualified individuals / households who need help to afford two specific types of expenses:\n\n* **Unexpected or emergency expenses that an individual or family living paycheck-to-paycheck could not possibly afford without a short-term hand-up.**\n<br>\n    Examples of expenses of this type with which Modest Needs has helped in the past include everything from the cost of medical care not covered by insurance to the cost of repairing or replacing a major appliance to the cost of required work tools or uniforms to the cost of legal fees to complete an adoption to - tragically - the cost of burying a family member that has unexpectedly passed away; and\n* **Monthly bills that an individual or family living paycheck-to-paycheck cannot afford to pay at the time of their application because of a documentable extenuating circumstance that occurred within the past year.**\n<br>\n    For example, if you were required to take unpaid leave from work because your child was ill and now cannot afford the cost of your auto insurance, or if you were in an auto accident and cannot afford this month''s rent or mortgage payment because you had to pay a deductible to repair your car - under these kinds of documentable emergency situations, Modest Needs would consider paying a regular monthly bill on behalf of your household on a one-time basis.\n\n**Grant Limitations**\nWhile we try to be as flexible as we can with the requests for assistance we receive, Modest Needs cannot ever help persons to afford expenses that fall into one or more of the following three categories:\n\n* **Expenses we are not permitted to pay as a matter of law.**\n    Expenses of this type would include federal, state, or local tax payments, including property tax payments, past-due child support payments, or fines / legal fees associated with a civil or criminal offense with which an applicant has been charged (for example, we can''t pay traffic tickets or help you to retain an attorney because you''ve been sued or charged with a crime).\n* **Expenses that we cannot pay on behalf of an applicant without sending cash or a gift card directly to that applicant.**\n    Modest Needs'' policies prohibit our sending cash directly to an applicant, so unfortunately, we cannot help applicants to afford, for example, the cost of groceries or gas, the cost of covering an overdraft in an applicant''s bank account, or the cost of repaying a payday loan.\n    Similarly, we can''t make a rental payment if, for example, an applicant is renting from a family member (this would be like giving cash directly to the applicant''s family), and we can''t help applicants to afford utility or rental deposits (these payments are returned to applicants as cash at the end of the rental term.)\n* **Expenses related to credit card debt, bankruptcy, or luxury items.**\n    At Modest Needs, we believe that the best kind of giving is responsible giving. So, as a matter of organizational policy, we do not help persons to afford credit card bills; the cost of filing for bankruptcy or making scheduled bankruptcy payments; or luxury goods / services of any kind (for example, the cost of replacing a broken television or the cost of taking your family on a vacation).\n\n**Apply Online** Once you have read over the eligibility requirements and confirmed that you likely qualify, you can apply online using [this link](https://www.modestneeds.org/for-applicants/apply-for-help.asp).','\n',char(10)),'Contact for an appointment. (Phone line is active 8am - 2pm EST)','','',replace('Modest Needs'' mission is to help **low-income workers** who are struggling to shoulder the burden of a short-term emergency expense.\nIn keeping with our mission, Modest Needs'' applicants must meet the following income and employment guidelines:\n* At least one adult member of the applicant''s household must be documentably employed at the time of the application; AND\n* The primary (largest) source of income for each applicant''s household must be either income earned from employment; or child support payments; or Veteran''s Benefits; or retirement income (including Social Security retirement benefits)\n\n**Modest Needs regularly makes grants to households receiving types of income other than those listed above (Social Security Disability Income, for example). However, in light of Modest Needs'' mission, applicants whose households do NOT meet the income and employment guidelines listed above will NOT qualify to apply for a grant from Modest Needs.**\nIf you need help to afford a short-term emergency expense but know that your household does not meet the income and employment guidelines listed above, please do not complete an application for assistance from Modest Needs. Instead, please consider contacting your local 2-1-1 and requesting a referral, or have a look at our [resource database](https://www.modestneeds.org/tools/resources/) to see if we list another agency that might be able to help you.','\n',char(10)),'129','239','No listed language support','240','129');
INSERT INTO Services VALUES('112','Refurbished Medical & Mobility Equipment','34','51','Active','The MSHH Donor Closet accepts donations of no longer needed medical and mobility equipment, refurbish and make it available at a reasonable "suggested donation price".','Wednesdays / Fridays / Saturdays, 10 AM - 3 PM','','','NONE','130','240','No listed language support','241','130');
INSERT INTO Services VALUES('113','Free Eyeglasses','35','52','Active',replace('New Eyes provides new prescription eyeglasses for children and adults in financial need throughout the United States who cannot afford glasses on their own. Eligible if living in a household at 250% or less of Federal Poverty Guidelines.\n\nThis program provides:\n- A pair of single or lined bifocal eyeglasses - lenses and frame. (2 identical pairs provided for children under 18) NOT progressives/transitions or special filter lenses.\n\nIndividuals can apply for themselves OR through a caseworker. The online application is accessible to social service agencies/health advocates who apply on their clients behalf and also to individuals who may apply directly.\nWhen you have an e-voucher from New Eyes, glasses must be ordered online from our partner dispenser www.neweyesglasses.org\n\nSocial Service Agencies or referring caseworkers will need the following information from their client:\n- Contact information including name, address, and email (if available)\n- Monthly approximate net income and expenses\n- A prescription for eyeglasses from a recent eye exam (within the last 24 months)\n\nAgency’s tax ID is needed as verification of a new agency registration. Please visit the website to apply.\nVouchers are good for three months from the date of issue.\n\nA $10 program fee applies.','\n',char(10)),'Apply online','','',replace('''- Applicants must have an email to apply directly and to ask questions to New Eyes. There is no telephone support. All customer care to info@new-eyes.org. Only refer clients with their email for a response please.\n- Applications can be made online 24/7. Individuals can apply through a referring case worker/health advocate/ support group OR directly through New Eyes website. The program is fully online and glasses will be ordered online by the applicant or caseworker from our partner dispenser and shipped out.\n- Applicants must hold a recent eye exam (dated within the last 24 months) including their pupillary distance (PD) measurement before applying. If it is not included on the eyeglasses prescription (preferable) you may measure it yourself. (Instructions on New Eyes website)\n- This program helps people with income at or below 250% of federal poverty guidelines.','\n',char(10)),'131','241','No listed language support','242','131');
INSERT INTO Services VALUES('285','After School Camp','107','10','Active','Many parents are looking for affordable, quality licensed childcare and have asked us to design an after-school program to meet their needs. Your child will be transported from school and brought to the Northeast Youth Center for an afterschool meal, recreational activities, homework help, arts & crafts, and weekly field trips.',replace('Weekly until 6:00pm\nClosed ALL federal holidays','\n',char(10)),'','','Call for more information or to register.','132','242','No listed language support','243','132');
INSERT INTO Services VALUES('284','Before School Camp','107','10','Active','Working early and can’t find someone to take your child to school? Mornings are so important for children to get off to a good start! Every morning your child will be greeted with fun & games, hair styling, last-minute homework help, BREAKFAST, and safe travel to school on time!',replace('Weekly 6:00am - Start of school\nClosed ALL federal holidays','\n',char(10)),'','','Call for more information or to register.','133','243','No listed language support','244','133');
INSERT INTO Services VALUES('287','Early Childhood Education and Assistance Program (ECEAP)','107','10','Active','Washington state’s comprehensive preschool program, The Early Childhood Education and Assistance Program (ECEAP), is designed to serve 3 and 4-year-old children and their families who meet the income and environmental eligibility criteria, and it is available for free. ECEAP is committed to preparing children for kindergarten through education, health and nutrition services, family support, advocacy training, and parent education. The ECEAP takes an approach that prioritizes long-term success, utilizing trauma-informed care, Conscious Discipline (a research-based social-emotional curriculum that prioritizes the adult’s role), enriched learning environments, and dedicated staff to promote social-emotional skills, resilience, and academic readiness.','Call for more information','','',replace('Children 3-5 years old who are (only 1 item needed to qualify): \n1. From a family with a low annual income (at or below 110 percent of the federal poverty level)\n2. Qualify for school district Special Education Services\n3. Have developmental or environmental risk factors that could affect school success\n','\n',char(10)),'134','244','No listed language support','245','134');
INSERT INTO Services VALUES('286','Winter/Spring Break Camp','107','10','Active',replace('WINTER\nAre you looking for a fun licensed camp while your children are on break? We have exactly that for you! Join us for fun, games, crafts and many more winter recreation activities that will knock your boots off! Need one day or the whole week, we can help you! Lunch Included.\n\nSPRING\nIf you are a working parent looking for quality and an affordable licensed day camp program to make your child’s spring break the best ever- this is the perfect place for your child(ren)! Registration accepted now with payment plan options available, state pay accepted (DSHS), includes field trips, breakfast & lunch! Hurry, camp space books fast!','\n',char(10)),'6:00am - 6:00pm','','','Call for more information or to register.','135','245','No listed language support','246','135');
INSERT INTO Services VALUES('114','A Hand Up (Hygiene Center)','37','53','Active','A Hand Up, provides clients within the 99207 and 99217 zip codes with personal hygiene products, cleaning supplies, paper goods and other health related items to meet their needs.  This is the only such resource in Spokane and unfortunately, we often have to turn away needy clients due to a lack of supplies.',replace('2nd & 4th Mondays of the month, 4 PM - 5:30 PM\n3rd Saturday of the month, 9 AM - 10 AM','\n',char(10)),'','','Must bring proof of residency within postal codes 99207 or 99217','136','246','No listed language support','247','136');
INSERT INTO Services VALUES('115','KidZone (Community Event)','37','53','Active','This is a bi-monthly ministry for children held on the first and second Thursday evenings during the school year providing them (and their parents) with a hot meal, games and opportunity to study the Bible.','1st & 2nd Thursdays of the month, evenings. (During the school year)','','','Must bring proof of residency within postal codes 99207 or 99218','137','247','No listed language support','248','137');
INSERT INTO Services VALUES('116','The Northeast Community Food Pantry','37','53','Active','The Northeast Community Food Pantry serves approximately 2800 families consisting of approximately 8900 individuals a year.  We are an outlet for the Second Harvest Food Bank and Northwest Harvest serving zip codes 99207 and 99217, but all those in need are welcome.  All of our workers are caring volunteers.',replace('Tuesdays 11 AM - 12:45 PM\nThursdays 9 AM - 10:30 AM','\n',char(10)),'','','Must bring proof of residency within postal codes 99207 or 99217','138','248','No listed language support','249','138');
INSERT INTO Services VALUES('117','CLEAR Hotline','38','54','Active',replace('CLEAR (Coordinated Legal Education, Advice and Referral) is a toll-free legal hotline for people with low incomes.\n\nBased on the information you give us, we may do one or more of the following: \n1. Give you verbal or written advice that may help you to solve your problem on your own; \n2. Send you written legal information and/or forms to help you solve the problem on your own; \n3. Try to resolve your problem through negotiation;\n4. Refer you to another legal aid service. \nWe try to make the best referral possible. We cannot guarantee that a referral will be available or that a referral agency or program will be able to help you.','\n',char(10)),'Weekdays, 9:15 AM - 12:15 PM','','','Before we can assist you, we must collect some information from you to determine if you are eligible for services. In most counties, persons who are 60 and over will not be denied assistance based on their income. Services are targeted to problems that affect basic needs such as housing, income, medical care and family safety. Due to limited resources, lawyers and paralegals are not able to assist every caller. ','139','249','No listed language support','250','139');
INSERT INTO Services VALUES('118','Eviction Help','38','54','Active',replace('Renters with low income facing eviction in Washington State can get free legal help. If your eviction case ends up in court and you are low-income, you have a right to a free lawyer.\nYou also have a legal right to an interpreter in your language.\n\nFill out the online form in English or Spanish or call the Eviction Defense line at 1-855-657-8387. Interpreters available in all languages.\n\nYou will be asked to provide:\n- Contact information, including your name, address, phone number, and email address\n- Income information and the number of people in your household\n- Personal information, including your date of birth, race and ethnicity, and gender\nIf you are eligible, someone will call you on the phone to connect you to an attorney from Northwest Justice Project or another legal service provider that may be in your area.','\n',char(10)),'Apply online.','','','Explained during the application process.','140','250','No listed language support','251','140');
INSERT INTO Services VALUES('220','Eviction Mediation','89','55','Active','Mediation is informal, voluntary, and confidential. The process gives the parties the opportunity to discuss the issues raised in the disagreement, clear up misunderstandings, determine underlying interests or concerns, and draft an agreement. Any agreement reached in mediation is the agreement of both parties.',replace('Fill out the form online to get started. Mediation is by appointment only.\n\nTo prepare for your mediation intake process with Northwest Mediation Center,\nplease be ready with this information (all of which is kept confidential):\n\n* Your name, address, phone and email information\n* Contact information for the other parties\n* Your attorney''s name (if you have one)\n* Your gross yearly income, for determination of your rate (see the [''Costs''](https://www.nwmediationcenter.com/costs) section)\n* Dates or times, during regular business hours, when you could participate in mediation\n* What kind of conflict it is (for example, parenting plan, marriage dissolution, landlord/tenant, business to business, etc.)','\n',char(10)),'','','Unlisted','141','251','No listed language support','252','141');
INSERT INTO Services VALUES('119','Monday Night Dinner','39','56','Active','','Mondays, 4 PM - 5 PM','','','NONE','142','252','No listed language support','253','142');
INSERT INTO Services VALUES('120','OBL Food Distribution Center','39','56','Active','','Mondays, 2 PM - 4 PM','','','NONE','143','253','No listed language support','254','143');
INSERT INTO Services VALUES('121','Car Seats','40','57','Active','Send completed forms (see attachments) to anne.zaro@ccs.spokane.edu. When approved, you will be notified and given a link to schedule a fitting with the SafeKids Coalition at Providence Hospital.','Apply via email (see details).','','','Families are eligible after they have exhausted all other avenues of assistance (DSHS, SNAP, etc.).','144','254','No listed language support','255','144');
INSERT INTO Services VALUES('122','Avista Assistance','41','58','Active',replace('Once per year, Our Place will provide Avista (utilities) assistance of up to $300 for West Central residents.\nCall on the first Tuesday of the month with your account number ready to share to request help.','\n',char(10)),'1st Tuesday of the month. (phone call only)','','','Must live in the West Central area.','145','255','No listed language support','256','145');
INSERT INTO Services VALUES('123','Bus Passes','41','58','Active','Our Place offers a limited amount of day bus passes, valid for up to 3 rides. Passes distributed during service on a first come, first serve basis through our Food Center check in table. ',replace('Wednesdays 4 PM - 6 PM\nThursdays 10 AM - 12:30 PM','\n',char(10)),'','','NONE','146','256','No listed language support','257','146');
INSERT INTO Services VALUES('124','Clothing & Housewares Outlet','41','58','Active','Clothing and household items are available to anyone in need, all dependent upon donations that come in. Our supply can change at a moment''s notice!',replace('Wednesdays 4 PM - 6 PM\nThursdays 10 AM - 12:30 PM','\n',char(10)),'','','NONE','147','257','No listed language support','258','147');
INSERT INTO Services VALUES('125','Food Distribution Center','41','58','Active','Our Free Fresh Market is open for anyone who is hungry, no documentation needed. Join us during service to "shop" for food from our free outdoor market!',replace('Wednesdays 4 PM - 6 PM\nThursdays 10 AM - 12:30 PM','\n',char(10)),'','','NONE','148','258','No listed language support','259','148');
INSERT INTO Services VALUES('126','Free Laundry Service','41','58','Active','Laundry is available on a first come, first served basis. Opens 9AM Tues & Thurs, & 2PM Weds. Last load must be in by 10:45AM Tues, 4:45PM Weds, and 11:15AM Thurs. Households of 1-2 people may do up to 2 loads/week; households of 3+ people may do up to 4 loads/week.',replace('Tuesdays 9 AM - 10:45 AM\nWednesdays 2 PM - 4:45 PM\nThursdays 9 AM - 11:15 AM','\n',char(10)),'','','NONE','149','259','No listed language support','260','149');
INSERT INTO Services VALUES('127','Hygiene Center','41','58','Active','Our Place distributes personal hygiene supplies to all, as our supplies allows. We offer items such as shampoo, toilet paper, feminine hygiene products, diapers, makeup, and more!',replace('Wednesdays 4 PM - 6 PM\nThursdays 10 AM - 12:30 PM','\n',char(10)),'','','NONE','150','260','No listed language support','261','150');
INSERT INTO Services VALUES('128','Clothing & Housewares Outlet','42','59','Active','As our flagship service line our clothing bank provides clothing, shoes, small kitchen appliances, household items, diapers, personal care items and newborn layettes to those in need.','Mondays / Tuesdays / Wednesdays / Thursdays, 10 AM - 3 PM','','','Proof of residency for all household members over the age of 18. Mail documents with home address dated within the last 30 days. Only services the following zipcodes: 99012, 99015, 99016, 99018, 99019, 99023, 99025, 99027, 99030, 99036, 99037, 99039, 99206, 99207, 99212 and 99216.','151','261','No listed language support','262','151');
INSERT INTO Services VALUES('129','Food for Thought','42','59','Active','In Spokane County 1 in 5 children live in "food insecure" homes. That means those families don''t have enough food for every family member to lead a healthy life. This doesn''t always mean that there is nothing to eat. But it can mean that children get smaller portions than they need, or parents aren''t able to afford nutritious foods. This food insecurity threatens a child''s well-being and potential for success. Food For Thought provides weekend meals for over 500 students each week to help improve school performance, academic success and cognitive development.','Call during standard business hours.','','',replace('Students must attend one of the following schools:\nAdams Elementary\nBowdish Middle School\nBroadway Elementary\nChester Elementary\nCVHS - Central Valley Alternative\nCVHS - Central Valley High School\nDishman Hills\nELC - Early Learning Center\nEvergreen Middle School\nEVSD - East Valley School District\nGreenacres Elementary\nLiberty Creek\nLiberty Lake Elementary\nMc Donald Elementary\nMica Peak High School\nNorth Pines Middle School\nOpportunity\nPonderosa\nProgress Elementary\nSouth Pines Elementary\nSpokane Valley Tech\nSummit School\nSunrise Elementary\nUniversity Elementary\nUniversity High School','\n',char(10)),'152','262','No listed language support','263','152');
INSERT INTO Services VALUES('130','Partners INW Food Bank','42','59','Active','Food Bank service is Monday-Friday from 9am-3pm. No appointment necessary. If you have any questions please give us a call (509) 927-1153.','Weekdays, 9 AM - 3 PM','','','Proof of residency for all household members over the age of 18. Mail documents with home address dated within the last 30 days. Only services the following zipcodes: 99012, 99015, 99016, 99018, 99019, 99023, 99025, 99027, 99030, 99036, 99037, 99039, 99206, 99207, 99212 and 99216.','153','263','No listed language support','264','153');
INSERT INTO Services VALUES('131','Utilities Assistance','42','59','Active','Partners INW provides emergency utility assistance for people with no place left to turn. In partnership with Avista, Modern Electric and Vera Spokane Valley Partners is able to provide financial assistance for utilities to residents in the Spokane Valley.  Additional assistance is also provided to seniors with needs including prescriptions and medical equipment. Depending upon current levels of funding, our Emergency Assistance may be able to provide short-term help. If we are not able to help, referrals to another Social Services agency will be made.','Weekdays, 8 AM - 4 PM','','','What to bring to your appointment: A current heating bill, picture ID and Social Security cards for all adults in the household, Verification of all household income for all persons in the home, including earned income (paystub), child support, SSI, SSA, SSD, TANF, Retirement, Unemployment, and Self-Employment. Other documentation may also be required.','154','264','No listed language support','265','154');
INSERT INTO Services VALUES('132','Affordable Computers','43','60','Active','PCs for People is a national nonprofit social enterprise working to get low-cost quality computers and internet into the homes of individuals, families, and nonprofits with low income. By recycling and then refurbishing computers, PCs for People provides a valuable service to businesses, families, and the planet by keeping computers out of landfills and repurposing them to advance digital inclusion.','Apply online.','','',replace('Identification:\nPhoto Identification (Driver''s license or State ID card, Passport, Formal ID Card for veterans or students, Company or work issued identification).\n\nProof of Income:\nThe prior year''s state, federal, or tribal tax return (W2 forms or pay stubs are not acceptable) OR Social Security statement of benefits OR Veteran Administration statement of benefits OR retirement/pension statement of benefits OR Unemployment/Workmen''s Compensation statement of benefits OR Federal or tribal notice letter of participation in General Assistance.\n\nOther Documents:\nProof of enrollment in an income-based government assistance program OR Documentation of current household income (under 200% of the federal poverty level or 60% of area median income).','\n',char(10)),'155','265','No listed language support','266','155');
INSERT INTO Services VALUES('250','Court Self-Help Services','104','61','Active','Free court forms, printing and scanning','Call for an appointment','','','Unlisted','156','266','Limited language access | Spanish','267','156');
INSERT INTO Services VALUES('252','FREE Legal & Immigration Clinic','104','61','Active',replace('Latinos En Spokane has diligently organized free monthly legal and immigration clinics in partnership with Gonzaga Law School, the Spokane County Bar Association Volunteer Lawyers Program, and Washington Courts. These clinics offer free legal consultations and advice, assistance with navigating court processes, reviewing documents, and court self-help services.\n\n**Monthly Legal Clinics**: Come in to talk to an attorney for FREE - 3rd Wednesday of every month from 5-7pm\n​\n**Monthly Immigration Clinics**: Come in to talk to an attorney for FREE - 2nd Thursday of every month from 5-7pm','\n',char(10)),replace('**Legal Clinics:** 3rd Wednesday of every month, 5 PM - 7 PM\n**Immigration Clinics:** 2nd Tuesday of every month, 5 PM - 7 PM','\n',char(10)),'','','None','157','267','Limited language access | Spanish','268','157');
INSERT INTO Services VALUES('251','FREE Notary Public Services','104','61','Active','Authenticating essential documents to prevent fraud and ensure legal compliance.','Call for an appointment','','','Unlisted','158','268','Limited language access | Spanish','269','158');
INSERT INTO Services VALUES('248','General Legal Aid','104','61','Active','Personalized referral to legal professionals, and assistance for individuals seeking to vacate their criminal backgrounds and obtain driver relicensing.','Call for appointment','','','Unlisted','159','269','Limited language access | Spanish','270','159');
INSERT INTO Services VALUES('249','Immigration Services','104','61','Active','We offer family-based petitions, asylum, DACA, Victims of Crime and family violence, work permits, waivers, applying for citizenship, renewals of permanent residence, screening for various forms of immigration benefits and relief, and assistance to documented and undocumented immigrants.','Call for an appointment ','','','Unlisted','160','270','Limited language access | Spanish','271','160');
INSERT INTO Services VALUES('133','Lifeline Cell Phone Program','45','62','Active','Lifeline is a federal program that offers free or reduced phones and plans.  Wireless companies in the area are offering the Lifeline program based on the zip code where you reside.  The program limits cell phones to one per household, not one per family member.','Tuesdays / Thursdays, 9:15 AM','','',replace('This program is income-based. If you meet one of these income levels or participate in a Federal Assistance Program (e.g. SNAP, Medicaid, SSI, FPHA), you may be eligible to take advantage of this benefit. Please arrive with one of the two options below to validate your identity and address to ensure your application is processed efficiently:\nOption 1 - One Document Only (Documents that validate both address and identity, Driver''s License)\nOption 2 - Combination of Address and Identify Validation (Utilitiy Bill/Medicaid Card with aplicant''s DOB)','\n',char(10)),'161','271','No listed language support','272','161');
INSERT INTO Services VALUES('134','Low-Income Housing Assistance','45','62','Active','We provide resources and information on low-income housing. Representatives from the Spokane Housing Authority can assist you to apply for property-based waitlists and can check the status of or make changes to a case.','Call during standard business hours.','','','Income-dependent.','162','272','No listed language support','273','162');
INSERT INTO Services VALUES('135','Reconnect2Work','45','62','Active','In partnership with the Spokane Workforce Council, Reconnect2Work is our region''s first-ever workforce development-focused childcare impact project. Whether you''re a parent wanting to return to the workforce, an early childhood learning/childcare center looking to grow your team, or a community job seeker with a passion to help develop a child''s skills and talents, Reconnect2Work will guide you to achieve your unique goals.','Call during standard business hours.','','',replace('''- Targeting families who are ineligible for Washington Working Connections Child Care (WCCC), and for whom lack of childcare is a barrier to them accessing the workforce.\n- Will support people who are accessing workforce services (education and/or training) with childcare as needed for them to pursue their program and enter employment.\n- Will also be supporting people who are currently working, who may be underemployed or need to work more hours.','\n',char(10)),'163','273','No listed language support','274','163');
INSERT INTO Services VALUES('214','Clothing Outlet','85','63','Active',replace('With this initiative, our goal is to promote confidence and great opportunities for those in need. We want people to look and feel their best. Learn more about our work by getting in touch with our team today.\nIf you need clothing, please indicate gender and size of clothes on the intake form so our staff and volunteers can assist you with gathering of some clothing items for you otherwise feel free to open shop at location.','\n',char(10)),'Contact for service times or fill out intake form on website.','','','Unlisted','164','274','No listed language support','275','164');
INSERT INTO Services VALUES('211','Food Pantry','85','63','Active','With this initiative, our goal is to promote great opportunities for those in need. With access to the right resources, people can become empowered by their own abilities and gain the confidence to fulfill their potential. Our food pantry serves everybody no matter your income or residence. Come as often as you need and replenish your inventory. Learn more about our work by getting in touch with our team today.',replace('Fridays, 5 PM - 7 PM\nSaturdays, 9 AM - 12 PM','\n',char(10)),'','','NONE','165','275','No listed language support','276','165');
INSERT INTO Services VALUES('213','Grocery Rescue Program','85','63','Active',replace('At Revive Community Services, we are dedicated to stepping up our efforts in addressing this issue. Food Donation Drop-Off or Pick-Up is by no means an easy feat, but through cooperation and community empowerment we believe we can facilitate progress in this area.\n\nTo encourage zero waste and alleviate hunger please consider providing our agency the opportunity to receive your unwanted or unsold goods or overstock. We are always striving to make a difference, and invite you to learn more and lend your support','\n',char(10)),'Contact or fill out intake form on website for service times.','','','Unlisted','166','276','No listed language support','277','166');
INSERT INTO Services VALUES('212','Homeless Outreach - Hygiene Care','85','63','Active',replace('With our organization’s mission always in mind, we strive to find new strategies for dealing with this challenge. Homeless Outreach is something that we take very seriously, and our team is working each and every day to make a positive impact.\nHygiene Care bags are available upon request so as long as the items are in stock. Contact us to learn more about our commitment to this cause.','\n',char(10)),'Contact for service times, or fill out intake form on website.','','','Unlisted','167','277','No listed language support','278','167');
INSERT INTO Services VALUES('136','Car Seats / Car Seat Fitting','46','64','Active',replace('This branch of SafeKids Worldwide is run through the Providence Sacred Heart Children''s Hospital.\nTo set up an appointment, first screen your family through CAPA (509-455-4986, https://www.cceasternwa.org/capa), then you''ll be set up with an appointment for evaluation and a car seat if needed.','\n',char(10)),'Apply online.','','','Must be a low income family to qualify for free car seats.','168','278','No listed language support','279','168');
INSERT INTO Services VALUES('240','Camp Gifford','47','65','Active',replace('Our summer camps are designed around the idea of inclusion. No one is turned away because of their circumstances. Under-served, from broken homes, in the foster care system, living in poverty, these are many of the at-risk children that come to our camp. Our camps are scholarship-based to financially support families in need. The costs involves are significant and purposeful investment in youth.\n\nOur main camp on Deer Lake works with children 7 - 12 years old.\nCamp Cougar, our wilderness camp, works with teens 13-17 years old. ','\n',char(10)),'Weekdays, all day (no specific times on website)','','',replace('Register online at this link:\n[The Salvation Army Camp Gifford Summer Camp Registration 2024 - Campaign](https://give-nw.salvationarmy.org/event/the-salvation-army-camp-gifford-summer-camp-registration-2024/e567434)','\n',char(10)),'169','279','No listed language support','280','169');
INSERT INTO Services VALUES('239','Celebrate Recovery','47','66','Active','Recovery isn''t just about drugs and alcohol! Celebrate Recovery is a welcoming and encouraging support group that focuses on the love of Christ and working through past hurts, current hang-ups, and habits that make recovery seem like an impossible task.','Thursdays, 5:30 PM - 7:30 PM','','','Unlisted','170','280','No listed language support','281','170');
INSERT INTO Services VALUES('137','Family Emergency Shelter','47','66','Waitlist Only','Helping Families in Crisis!  11 fully furnished, self-contained, studio units for homeless families with children. Participants can stay for up to 90 days while working with a case manager, attending monthly Life Skills classes, working to increase their income, and seeking appropriate, affordable housing.','Call during standard business hours.','','','Family must be working with a case manager, attending monthly Life Skills classes, working to increase their income, and seeking affordable housing.','171','281','No listed language support','282','171');
INSERT INTO Services VALUES('138','Food Distribution Center','47','66','Active','We provide one of the largest food bank outlets in the community; serving an average of 1,500 families in Spokane County every month.  By offering access to free, fresh produce and canned goods, we provide valuable meal supplementation while helping those in need maintain their independence and dignity.','Weekdays, 9 AM - 4:15 PM','','','NONE','172','282','No listed language support','283','172');
INSERT INTO Services VALUES('139','Stepping Stones Transitional Housing','47','68','Waitlist Only','A 30-unit apartment complex for homeless families with children who are at, or below, 30% to 50% of the area median income for Spokane County. All families must participate in case management and Life Skill classes. Families may reside in this program for up to 24 months while they work to increase their income, pay off debt, address the issues that caused their homelessness, and find affordable housing.','Call during standard business hours.','','','Family must meet HUD standards of 30% to 50% of Spokane''s Annual Medium Income. Family must participate in case management, Life Skills classes, work to increase their income, pay off debt, address the issues that caused their homelessness, and find affordable housing.','173','283','No listed language support','284','173');
INSERT INTO Services VALUES('140','The Way Out Bridge Housing Center','47','69','Active','The Way Out Bridge Housing Center at 55 W. Mission, Spokane offers a healthy alternative to living on the streets or in shelters. This Center''s program is designed for adults who sincerely want to exit homelessness and find permanent housing and employment. This program requires work on an individual''s part so that he/she can change their life. In addition to housing, food, and overnight lodging, The Salvation Army supplements those services with the support needed to move on in life.',replace('''- Line up for Shelter services begins at 2:30pm.  \n- Check-in begins at 3:00pm as long as there are beds available beginning on Monday, December 14th, 2020.\n- Clients in the neighborhood (within 1 to 2 blocks) of The Way Out Bridge Housing Center, cannot loiter until check-in time.  They will be criminally trespassed if they do so.','\n',char(10)),'','','Must be homeless, first come first serve.','174','284','No listed language support','285','174');
INSERT INTO Services VALUES('141','Brown Bag Commodities Program','48','70','Active',replace('The Brown Bag program is a partnership between Catholic Charities Eastern Washington and Second Harvest Food Bank. Second Harvest provides and packages the food that Catholic Charities'' volunteers deliver to those who otherwise would not be able to get to a food bank. There are approximately 45 volunteers driving food to the 500 people in this program.\n\nQuestions? Please contact: Cyndie Lapke - VCS Program Manager | 509.459.6172','\n',char(10)),'Call during regular business hours.','','','Must be of retirement age.','175','285','No listed language support','286','175');
INSERT INTO Services VALUES('142','Volunteer Chore Services','48','70','Active',replace('Volunteer Chore Services provides a wide range of household tasks and assistance that enable low-income elderly and disabled clients to remain in their own homes with dignity, safety, and a connection to their community. Assistance includes housework, laundry, transportation, shopping and various other independent living requests. Volunteers also participate in one-time projects such as moves and yard clean-ups.\n\nVolunteers are screened, oriented and trained according to Washington State law, Volunteer Chore Service contract requirements and Program/Agency policies.','\n',char(10)),'Call during regular business hours.','','','Must be of retirement age.','176','286','No listed language support','287','176');
INSERT INTO Services VALUES('143','Bite To Go Meal','49','71','Active','In the Spring of 2012 Serve Spokane began partnering with 2nd Harvest to provide child-friendly weekend meals for food-insecure children who depend on free or reduced cost meals in the local schools for a significant portion of their nutrition.',replace('Tuesday, 1:00pm-2:30pm\nThursday,1:00pm-3:30pm\nSaturday, 9:00am-11:30am','\n',char(10)),'','','NONE','177','287','No listed language support','288','177');
INSERT INTO Services VALUES('144','Clothing & Housewares Outlet','49','71','Active','Our Clothing Bank serves an average of 500 families each month, providing over 1500 pounds of clothing.  We provide clean, comfortable, useful clothing and household goods to those who need a supporting hand, where you can shop in an atmosphere of love and friendship.',replace('Tuesdays 1 PM - 2:30 PM\nThursdays 1 PM - 3:30 PM\nSaturdays 9 AM - 11:30 AM','\n',char(10)),'','','NONE','178','288','No listed language support','289','178');
INSERT INTO Services VALUES('145','Food Distribution Center','49','71','Active','Our food pantry serves an average of 3000 people each month giving out approximately 50,000 pounds of food. In addition to our regular pantry services, in partnership with 2nd Harvest, we operate The Emergency Food Assistance Program (TEFAP) and the Commodity Supplemental Food Program (CSFP-Senior Boxes) as well as Bite to Go Meals for kids in our local school.',replace('Tuesday, 1:00pm-2:30pm\nThursday, 1:00pm-3:30pm\nSaturday, 9:00am-11:30am','\n',char(10)),'','','NONE','179','289','No listed language support','290','179');
INSERT INTO Services VALUES('146','Dining with Dignity','50','72','Active','Serves Breakfast and Dinner.',replace('Breakfast: Mondays & Thursdays, 7:30 AM - 8:30 AM\nDinner: Mondays & Tuesdays, 4:30 PM - 5:30 PM','\n',char(10)),'','','Call for information.','180','290','No listed language support','291','180');
INSERT INTO Services VALUES('147','Mobile Dental Care','51','73','Active','The SmileMobile accepts Apple Health (Medicaid, ProviderOne, Molina), individuals and families with no insurance.','Location varies by date, appointment must be scheduled, see website for details.','','','Children, youth, pregnant, postpartum women.','181','291','No listed language support','292','181');
INSERT INTO Services VALUES('148','Food Distribution Center','53','74','Active','We serve all people without requiring any documentation. You will be asked a few simple demographic questions. Anyone who joins the line before 12pm will be served.','Saturdays, 11 AM - 12 PM','','','NONE','182','292','No listed language support','293','182');
INSERT INTO Services VALUES('246','Food Bank','102','75','Active','Providing food for those that need it',replace('Fridays,\n\- Lines form at 8 AM\n\- Food Distribution starts at 10 AM\n\- Closed by noon','\n',char(10)),'','','Unlisted','183','293','No listed language support','294','183');
INSERT INTO Services VALUES('247','Youth Program','102','75','Active',replace('After-School Program during the school year and Summer Program during the Summer months\n\n## After school program\n\nWe pick up the kiddos from the school bus stop from Roosevelt on the eastside of Coeur d''Alene Park and walk to the Center. The kids have a snack before beginning their homework. We provide as much help and support as we can for the kiddos with their homework. Then the kids have the option to play on the computers for a bit. After that''s out of the way, we have some fun! We have board games, a park across the street, open spaces indoors, art supplies, and more!\n\n## Summer Program\n\nWe serve breakfast and lunch provided by the Summer Meals Program with Spokane School District 81. We take many field trips and outings throughout the summer, including Liberty Pool every Friday. Several volunteers join us in the summer to have fun with the kids too!','\n',char(10)),'Seasonally dependent','','','See attached application forms.','184','294','No listed language support','295','184');
INSERT INTO Services VALUES('149','Medical Transportation','54','76','Active',replace('SMS helps clients who cannot get to and from their appointments by their own means. SMS offers pick-up/drop-off services (must be scheduled two business days in advance). They have a form available on their website for download (and attached to this item) that needs to be faxed to them, and you can do several appointments on it at one time.\n- They also have two hour bus passes (great for large families with lots of children), you can request them the same as the ride, but fax the forms to 534-6980\n- SMS also has gas vouchers for long distance travel (think Spokane to Seattle), these can take a while to go through, so be proactive with them. Fax the forms to 319-3434','\n',char(10)),'Apply online.','','',replace('''- Must have a current Medical Assistance Identification Card that you use to pay for your healthcare (Must be on Medicaid), and you have no other way to get to and from your healthcare appointments.\n- Healthcare appointments must be for services allowed by your medical program.\n- Must give at least two business days'' notice.','\n',char(10)),'185','295','No listed language support','296','185');
INSERT INTO Services VALUES('150','Lions Sight and Hearing Program','55','77','Active','The Spokane Central Lions Club services committee has been enabled to provide free eyeglasses and hearing aids to those who cannot afford to purchase them.','Call during standard business hours.','','',replace('Annual income of less than $18,000 for a single person household, or 133% of the Federal Poverty Level for all others. Required proof of income.\n- For vision assistance, the applicant cannot have received services from Spokane Central\nLions for either sight or hearing within two years of application\n- For hearing assistance, the applicant cannot have received any hearing services from\nSpokane Central Lions (hearing assistance is a one-time only service)\n- For hearing assistance, documentation of income is required (for example, income tax\nform, copy of SSI benefit or bank statement)','\n',char(10)),'186','296','No listed language support','297','186');
INSERT INTO Services VALUES('244','Food & Resource Center','99','78','Active','SCC operates a food pantry for currently enrolled students! Full and part time students, faculty, and staff may visit the Food Pantry and Resource Center up to three times per quarter. Items vary but usually include dry goods, canned goods, frozen ingredients, refrigerated staples, as well as hair and body care products.',replace('DURING THE QUARTER\nTuesday, Wednesday, Thursday, 9 AM - 4 PM\nHours subject to change, contact the Student Leadership Center for more info.','\n',char(10)),'','','All currently enrolled students are eligible – visit the Food Pantry and Resource Center located down the hallway from the Student Leadership Center in Bldg 6, Room 102. All you need is your student ID! (Student ID cards can be obtained for free from Bigfoot Central in Bldg 15).','187','297','No listed language support','298','187');
INSERT INTO Services VALUES('151','Online Lawyer Referral Service','56','79','Active','The SCBA Online Lawyer Referral Service refers potential clients to the panel members by providing the contact information for up to three panel attorneys when the request form has been completed and if an attorney is presently enrolled in the particular area of law requested.  It is up to the person requesting the referral to reach out to the panel attorneys to discuss potential advise/representation.','Apply online.','','','NONE','188','298','No listed language support','299','188');
INSERT INTO Services VALUES('152','Volunteer Lawyers Program','56','79','Active',replace('The Volunteer Lawyers Program (VLP) is a legal assistance program of the Spokane County Bar Association. The VLP recruits volunteer attorneys to provide free legal advice in civil matters (non-criminal) to low-income individuals in Spokane County and four outlying counties, i.e. Pend Oreille, Ferry, Stevens and Lincoln. It is funded primarily by a grant from the Legal Foundation of Washington and contributions from local attorneys and annual fundraisers.\n\nIf you are in need of Family Law or limited assistance with Wills and Estates, or Bankruptcy Services call (509) 477-6123\n\nIf you are looking for information regarding upcoming Free Legal Aid Clinic’s call (509) 477-2674','\n',char(10)),replace('Call for an appointment.\nAvailable Weekdays, 8:30 AM - 12 PM & 1 PM - 4 PM','\n',char(10)),'','','Must qualify as low income.','189','299','No listed language support','300','189');
INSERT INTO Services VALUES('153','Ministry Resource Center','57','80','Active','The resource center enables us to reach out into the community and help many needy people and families. We are currently feeding about 16,000 people per month, including five ministries in north Idaho, eight ministries in the Spokane area, and approximately twenty churches. Whether with prayer, fellowship, emergency food and/or clothing, ministry information or referral to other ministries or organizations, we always do our best to serve with joy.',replace('Tuesdays - Wednesdays, 12:30 PM - 3 PM\nThursdays, 11:30 AM - 1 PM','\n',char(10)),'','','NONE','190','300','No listed language support','301','190');
INSERT INTO Services VALUES('154','Birth-to-3 Program','58','81','Active','HOPE’s certified Teacher of the Deaf/Hard of Hearing serves children who are deaf or hard of hearing, ages birth to three, starting at the time of diagnosis.  Through in-home visits, parents are coached how to develop effective communication with their baby. HOPE honors and supports parents’ communication modality choice for their child. Sign language may be modeled during the first months of communication development. Parents who choose listening and spoken language are coached to increase their child’s awareness to sound, to attend to sounds in the environment, and to develop the early communication skills that will lay a foundation for speech and language during the critical brain development time.','Call during regular business hours','','','NONE','191','301','No listed language support','302','191');
INSERT INTO Services VALUES('155','Preschool Program','58','81','Active',replace('Preschool students receive individualized and small group instruction from a certified Teacher of the Deaf/Hard of Hearing, LSL specialist, Speech-Language Pathologist and music educator.  The average ratio of 3:1 among students and adults in the classroom ensures an intimate, child-centered school experience where every child has the opportunity to hear and be heard.\n\nEvery moment is intentionally planned to build the auditory brain. Curriculum is aligned to Washington state kindergarten readiness standards and is designed to prepare children for successful transition to a general education kindergarten classroom. \n\nNormal hearing peers, who model age-appropriate speech and language for students with hearing loss, may also be enrolled in both the Preschool and the Toddler programs.  For information on registering a child for this program, please contact info@spokanehope.org.','\n',char(10)),'Call during regular business hours','','','NONE','192','302','No listed language support','303','192');
INSERT INTO Services VALUES('156','Toddler Group','58','81','Active','Toddlers participate, along with a parent/caregiver, in structured play activities under the guidance of a certified Teacher of the Deaf/Hard of Hearing LSL specialist, a Speech Language Pathologist and music educator. HOPE’s Toddler Group is focused on nurturing caring and collaborative partnerships with parents that facilitate spoken language development. Activities are designed to promote listening and speaking strategies that can be carried over into the home and practiced through daily life activities.','Call during regular business hours','','','NONE','193','303','No listed language support','304','193');
INSERT INTO Services VALUES('157','SNAP Resource Rides','59','115','Active','SNAP Resource Rides can provide rides to clients who are pregnant or have recently had a baby and have limited or no access to transportation (included needs assessments as well as assistance with referrals and access to other resources in the community to meet the needs of these families). Can also provide rides to clients to a grocery store or food bank (Please reach out to Aimee Moses for more information on this: 509-319-3050 or moses@snapwa.org). Can also provide rides to Spokane County residents 65+ years of age and/or persons living with disabilities, who otherwise would not qualify or be able to utilize public transportation options, Riders are able to request rides for medical related transportation needs such as attending an appointment with a Primary Care Physician or picking up a prescription at their local pharmacy.','Call during standard business hours.','','','Service Dependant.','194','304','No listed language support','305','194');
INSERT INTO Services VALUES('158','Utilities Assistance','59','83','Active','Energy assistance comes in the form of a few different programs. Learn more about these programs below. Because different programs have different eligibility requirements, we encourage you to review which/if any programs you may qualify for to help maximize the help you may receive. Energy-Heating Assistance, Emergency Energy Assistance, Avista Emergency Assistance - LIRAP Share, Avista My Energy Discount WA, Avista Arrearage Management, Free Wood Program (In partnership with Airway Heights Correctional Center), U-HELP Water Assistance, Utility Bill Releif Fund (ARPA), Furnace Repair, Air Cooling - Purification.','Call during standard business hours.','','','Service Dependant.','195','305','No listed language support','306','195');
INSERT INTO Services VALUES('159','HEART Program','60','84','Active',replace('Homeless Education And Resource Team (HEART): Spokane Public Schools'' program for implementing the federal McKinney-Vento Education Assistance Act and the state Homeless Student Stability and Opportunity Grant Act.\n\nThe HEART program helps children and youth who lack a fixed, regular and adequate nighttime residence. This includes children and youth who are:\n- Sharing the housing of others due to loss of housing, economic hardship or a similar reason\n- Living in motel, hotels, trailer parks or campgrounds due to the lack of alternative adequate accommodations\n- Living in emergency or transitional shelters\n- Abandoned in hospitals\n- Living in places that are not regular sleeping accommodations for people\n- Living in cars, parks, public spaces, abandoned buildings, substandard housing, bus or train stations, or similar settings\n- Unaccompanied Youth, youth who are not in the physical custody of their legal parent/guardian, are able to access services on their own.\n\nAs homeless education facilitators, we:\n- Locate and enroll students in the HEART program\n- Protect a student’s "School of Origin" – the school that a student last attended when permanently housed\n- Coordinate transportation to student''s "school of origin"\n- Communicate to each school regularly about HEART students currently enrolled in their building and contact teachers and/or school officials about developing issues\n- Serve as a liaison between the school, parents, students and community agencies to meet the educational needs of students\n- Accumulate statistics about the mobility of students experiencing homelessness\n- Visit school buildings to support students, staff and parents with any issues/concerns\n- Network with other community agencies and programs involved with homelessness to coordinate advocacy efforts and link community services\n- Assist in obtaining educational documents and records\n- Ensure that children and youth, including unaccompanied youth, enroll and have a full and equal opportunity to succeed in school','\n',char(10)),'Call during regular business hours.','','','Must be a student who is homeless or outside of their school boundary for a limited time.','196','306','No listed language support','307','196');
INSERT INTO Services VALUES('238','Access to Baby & Child Dentistry (ABCD)','94','85','Active',replace('Spokane Regional Health District (SRHD) program staff help eligible kids access ABCD-certified dentists by providing case management and technical assistance.\nIf a child has Apple Health (Medicaid), he/she is eligible to receive the following through ABCD:\n\n* Fluoride varnish applications\n* Dental examinations\n* Parent education sessions\n* Restorative care as needed\n\nChildren who participate in the ABCD program are more likely to have their first dental visit before age 2 and receive care before oral health problems arise. They also have the opportunity to receive dental care from one of more than 100 ABCD-certified dentists in Spokane County.\n\nThe goal of ABCD is to reduce the extent of disparities in dental health for Spokane’s young children by decreasing dental disease rates with early access to preventative dental care. ABCD emphasizes early intervention, prevention, education and comprehensive care.','\n',char(10)),'Appointment dependent.','','','Any child under age 6 who has Apple Health (Medicaid) benefits is eligible for the ABCD program.','197','307','No listed language support','308','197');
INSERT INTO Services VALUES('160','Poverty Program','62','86','Active','We are called by our Mission Statement to be aware of and live out Gospel values, especially in the way we respond to the poor and needy among us. The goal of the Poverty Program is to assist with help for food, utilities, and medical needs for those in emergency situations living in our parish boundary, and referring persons to other agencies when we can''t help. Reaching out, touching, helping on a human level, will bring hope and relief, and a knowing that they are cared about. The Poverty Program at St. John''s is totally supported by donations from people in the parish. For assistance, please call the parish office at (509)926-5428.','Tuesday, Wednesday and Thursday, 9 AM - 12 PM','','','This program serves individuals within the parish boundary.','198','308','No listed language support','309','198');
INSERT INTO Services VALUES('161','Emergency & Transitional Housing','63','87','Active','St. Margaret’s ensures that families coming from homelessness, incarceration or drug treatment or fleeing domestic violence have safe, warm and welcoming living spaces that provide dignity. We offer stabilization services that are driven by the families we serve and provide housing and vocational experts to assist families with resources and connections to community partners and programs. Our goal is to serve as a brief stop that helps families’ on their path toward moving in to their permanent, new home.','Call during regular business hours.','','','This program requires a referral from the Homeless Family Coordinated Assessment (or HFCA) program.','199','309','No listed language support','310','199');
INSERT INTO Services VALUES('162','Family Support','63','87','Waitlist Only','As St. Margaret’s families transition into their new homes and build stable lives, staff and volunteers provide resources that support them in that transition. These resources include an in-house food bank, The Pearl Boutique, on-site laundry facilities, one-on-one parenting support, Homework Club, healthy relationship coaching and an annual wellness program.  Aftercare support services are available to all St. Margaret’s families after discharging from our programs without time limits.','Call during regular business hours.','','','This program requires a referral from the Homeless Family Coordinated Assessment (or HFCA) program.','200','310','No listed language support','311','200');
INSERT INTO Services VALUES('163','Stabilization Services & Community Partnerships','63','87','Active',replace('The work of St. Margaret’s extends beyond the shelter into partnerships with community organizations designed to help families transition and become stable in their new homes. These partnerships with other organizations help prevent families from falling into crisis and provide holistic transformation. These partnerships include the following programs:\n\nThe Homeless Student Stabilization Program partners with Spokane Public Schools and the Spokane Regional Health Department. This program places community health workers in schools to help prevent child trauma from homelessness and increase the chance that students will graduate high school.','\n',char(10)),'Call during regular business hours.','','','This program requires a referral from the Homeless Family Coordinated Assessment (or HFCA) program.','201','311','No listed language support','312','201');
INSERT INTO Services VALUES('164','Clothing Outlet (Downtown)','64','88','Active',replace('TKC is a brick-and-mortar shop in Spokane, serving all of eastern WA and North ID. Every shopper, from babies to young adults is welcome to our free shop. Each child has to be referred by someone of authority: a social worker, school counselor, etc.\n\nChildren are allowed to shop once every six months.','\n',char(10)),replace('1st & 3rd Saturdays of the month, 8 AM - 2 PM\n2nd & 4th Wednesdays of the month, 4 PM - 7 PM','\n',char(10)),'','','Must be referred by someone of authority, a social worker, school counselor, case manager, etc.','202','312','No listed language support','313','202');
INSERT INTO Services VALUES('165','Clothing Outlet (North)','64','89','Active',replace('TKC is a brick-and-mortar shop in Spokane, serving all of eastern WA and North ID. Every shopper, from babies to young adults is welcome to our free shop. Each child has to be referred by someone of authority: a social worker, school counselor, etc.\n\nChildren are allowed to shop once every six months.','\n',char(10)),replace('1st & 3rd Saturdays of the month, 8 AM - 2 PM\n2nd & 4th Wednesdays of the month, 4 PM - 7 PM','\n',char(10)),'','','Must be referred by someone of authority, a social worker, school counselor, case manager, etc.','203','313','No listed language support','314','203');
INSERT INTO Services VALUES('166','Assistive Technology Center','65','90','Active',replace('The ATC provides technology consultations and demonstrations of devices. If you reach out to the ATC for either of these options, you can expect:\n\n• Technology Consultations – our ATC Coordinator will meet with you in-person or virtually to discuss what AT you may have tried already, what works or doesn’t work for you, what your goals are, and then will provide recommendations for what AT might work best for you.\n\n• Technology Demonstrations/Training – the ATC is equipped with many different types of AT that may be beneficial for you to try. We want you to know what works best for you before you purchase anything on your own. We can also help you learn how to use the devices you already have.','\n',char(10)),replace('• A pre-consultation questionnaire will be e-mailed to the client and they will send their responses back within a week.\n\n• The coordinator will look over the responses and reply within four business days with several possible consultation dates and times.\n\n• The ATC will set up a consultation in person or through video conferencing.\n\n• If any training is needed, the ATC will provide it.\n\n• The ATC uses a client-centered approach, but also welcomes family, friends, educators, etc.indicated by the client in addressing technology needs.','\n',char(10)),'','','Must require assistance with specialized technology developed for disabled individuals. Or must be a disabled individual in need of assistance with learning how to use technology.','204','314','No listed language support','315','204');
INSERT INTO Services VALUES('167','The Arc Thrift Store - North Spokane','65','91','Active','Come on in for great deals on fantastic, thrifted finds and support The Arc’s services and programs for people with intellectual and developmental disabilities (IDD) and their families.',replace('Monday-Saturday, 10 AM - 7 PM\nSundays, 10 AM - 6 PM','\n',char(10)),'','','NONE','205','315','No listed language support','316','205');
INSERT INTO Services VALUES('168','The Arc Thrift Store - Spokane Valley','65','92','Active','Come on in for great deals on fantastic, thrifted finds and support The Arc’s services and programs for people with intellectual and developmental disabilities (IDD) and their families. ',replace('Monday-Saturday, 10 AM - 7 PM\nSundays: 10 AM - 6 PM','\n',char(10)),'','','NONE','206','316','No listed language support','317','206');
INSERT INTO Services VALUES('169','The Community Center','65','90','Active',replace('Our community center is a fun, busy hub of activity with opportunities for adults to learn and grow. People with and without developmental disabilities are encouraged to build friendships in daily or weekly sessions through games, enrichment classes, and group outings around Spokane.\n\nUnannounced drop-ins are no longer being accepted. Members must reserve their time 24 hours in advance by calling (509) 789-8791, M-F, 8:30 a.m.-3:30 p.m. All available slots will be filled first-come, first-served. Members can reserve time up to one week in advance.','\n',char(10)),'Community Center attendance will be capped based on staffing levels, typically with 60 members per session. The morning session is 8:30 a.m.-noon, and the afternoon session is from noon-3:30 p.m.','','','Restrictive health policy due to many participants being immunocompromised in one way or another. Must also either call this number: (509)789-8791 or apply online for an appointment.','207','317','No listed language support','318','207');
INSERT INTO Services VALUES('170','Business Support','66','93','Active','We provide technical and financial support to local Black businesses to remove barriers to success and promote sustainability. We formed the Black Business & Professional Alliance, the Black Business Support Team and created an online Black Business Directory at blackspokane.com.','Call for an appointment','','','NONE','208','318','No listed language support','319','208');
INSERT INTO Services VALUES('171','COVID-19 Services','66','93','Active','We provided access to COVID-19 education, resources and testing. We also partnered with the Native Project, Terrain, the Spokane Minister''s Fellowship and Freedom Project East to provide COVID-19 vaccination clinics.','Call for availability','','','NONE','209','319','No listed language support','320','209');
INSERT INTO Services VALUES('172','Rental & Utility Assistance Program','66','93','Select Cases',replace('We partnered with the City of Spokane to provide rental assistance funding to African Americans and the BIPOC population in the greatest need.\n\nOur Rental Assistance Application Portal is not open to the general public. \n\nWe are accepting & reviewing applications on a case-by-case basis. A member of the rental assistance program team will contact you after your application has been submitted.','\n',char(10)),'We are accepting & reviewing applications on a case-by-case basis. A member of the rental assistance program team will contact you after your application has been submitted.','','','NONE','210','320','No listed language support','321','210');
INSERT INTO Services VALUES('173','Student Tech Fund','66','93','Active','We partnered with Comcast to provide technology and supplies to students who struggled with remote learning during the COVID-19 pandemic in order to prevent students of color from falling further behind.','Call for an appointment.','','','NONE','211','321','No listed language support','322','211');
INSERT INTO Services VALUES('174','Free Books & Toys','67','94','Seasonal Closure','Children in the home ages 17 and younger are eligible to receive one toy, and children ages 15 and younger will also receive an age-appropriate book.','Seasonal hours, check website.','','',replace('Please plan on bringing the items listed below when you arrive to the Fairgrounds:\nFor adults (18yrs and older):\nBring photo ID (for grocery voucher recipient), and proof of current address for each adult in the household. Examples of acceptable documentation: Bills; Rental Agreement?\n\nFor children (17yrs and younger):\nBring proof of name and date of birth, or age for each child. Examples of documentation for children: birth certificate; insurance card; letter from school, DSHS or day care; WA Apple Health Statement; WIC letter','\n',char(10)),'212','322','No listed language support','323','212');
INSERT INTO Services VALUES('175','Grocery Vouchers','67','94','Seasonal Closure','Each eligible household will receive a grocery voucher. Your valid photo ID must match the name on the voucher to redeem at participating grocery stores.​','Seasonal hours, check website.','','',replace('Please plan on bringing the items listed below when you arrive to the Fairgrounds:\nFor adults (18yrs and older):\nBring photo ID (for grocery voucher recipient), and proof of current address for each adult in the household. Examples of acceptable documentation: Bills; Rental Agreement?\n\nFor children (17yrs and younger):\nBring proof of name and date of birth, or age for each child. Examples of documentation for children: birth certificate; insurance card; letter from school, DSHS or day care; WA Apple Health Statement; WIC letter','\n',char(10)),'213','323','No listed language support','324','213');
INSERT INTO Services VALUES('176','Clothing Outlet','68','95','Active','Our clothing bank is open four days a week (Tues - Fri) during regular business hours (10:00 am to 2:30 pm). We provide a wide variety of clothing, shoes, coats, blankets and toiletries for men, women and teenagers. Each guest may use the clothing bank services one time per month as needed. Please come in at 10am OR 12:30pm, to ensure an appointment that day. Appointments are first come, first serve with walk-ins only.','Tuesdays / Wednesdays / Thurdays / Fridays, 10 AM - 2:30 PM','','','Must provide proof of residency within these zipcodes: 99201, 99204, 99224.','214','324','No listed language support','325','214');
INSERT INTO Services VALUES('177','The Alberta House','68','95','Active','The Alberta House apartments are a safe place designed to help those in need. Located above The City Gate, we own and operate 28 low-cost studio apartments, mainly SRO''s (Single Room Occupancy''s) and two emergency shelter rooms. During the Grand Opening in 2000, The City Gate was blessed by various churches and individuals taking part in adopting an apartment where they furnished and decorated accordingly. The idea of having furnished apartments is to meet the need for those who rent from us but have nothing. The Alberta House provides clean and safe low-cost housing with a family atmosphere including a common area for watching TV and relaxing. For more questions and/or availability, please call (509) 456-5466.','Call during standard business hours.','','','Call for information.','215','325','No listed language support','326','215');
INSERT INTO Services VALUES('178','The City Gate Food Bank','68','95','Active','The City Gate food bank is one of Spokane''s Second Harvest food distribution providers. We are able to serve our clients who live in the 99201 (south of the river), 99204 and parts of 99224 every 30 days with 35lbs of food for single dwellers. The food bank is a client choice food bank which allows clients to ''shop'' for items they want/need rather than receiving a box of miscellaneous items.','Call during standard business hours.','','','Must provide proof of residency within these zipcodes: 99201, 99204, 99224.','216','326','No listed language support','327','216');
INSERT INTO Services VALUES('179','The Kitchen','68','95','Active','We receive food donations from several local grocery stores such as Albertsons, Costco, Walmart, Yokes and Rosauers as well as Union Gospel Mission and various churches and individuals. The kitchen always serves pastries and coffee. Breakfast (8 am) and lunch (11:30) are provided Tue-Fri. We have an amazing cook and one staff member who oversee the kitchen and several regular volunteers who help keep our kitchen running. We thank God for providing them as they are such a blessing!','Tuesdays / Wednesdays / Thurdays / Fridays, 8 AM & 11:30 AM','','','Call for information.','217','327','No listed language support','328','217');
INSERT INTO Services VALUES('180','Shelter Me Spokane','69','96','Active','Website that shows all available shelters in Spokane','Website application tool.','','','If you or someone you know is a victim of domestic violence and need help, please contact the YWCA 24-Hour Helpline at 509.326.2255 or text 509.220.3725.','218','328','No listed language support','329','218');
INSERT INTO Services VALUES('181','Free Community Drop-In Legal Clinics','70','93','Active',replace('1st, 3rd, and 4th Thursdays in October. First Come, First Served. Please pre-register by emailing us at: selfhelplegal@carlmaxeycenter.org. Doors open at 4:45 for Thursday clinics, last check in at 6:00 p.m.\n\nWe do not provide specific legal advice about your legal matter, but can help with general legal advice and information.  Our attorneys are volunteers and are available during our clinic times. We do not represent people in court.\n\nPLEASE preview information about your case type at WashingtonLawHelp.org prior to attending a Clinic.\n\nFree 30-minute consultation with an attorney or legal professional to ask questions.','\n',char(10)),'1st, 3rd, & 4th Thursdays in October. 4:45 PM - 6 PM','','','NONE','219','329','No listed language support','330','219');
INSERT INTO Services VALUES('182','Legal Self-Help Center','70','93','Active','Self-help center for legal matters.','Call for an appointment','','','NONE','220','330','No listed language support','331','220');
INSERT INTO Services VALUES('183','Racial Justice Legal Clinics','70','93','Active',replace('2nd Wednesday of each month for Black, Indigenous, People of Color. Civil Rights and Discrimination in Housing, Employment, Services, governmental agencies, court services, law enforcement, language access. Civil Law including Family Law, Domestic Violence, Consumer, Credit, Evictions, Post Conviction Relief and all other areas excluding criminal law.\n\nIf you are not sure if you have a legal matter and want to ask an attorney what options you may have and if your issue is a legal matter, please contact us at selfhelplegal@carlmaxeycenter.org','\n',char(10)),'2nd Wednesday of the month, 10 AM - 2 PM','','','NONE','221','331','No listed language support','332','221');
INSERT INTO Services VALUES('241','Driver''s Relicensing','97','97','Active','We help our clients restore their driving privileges, by removing old court fines from collections and empowering our clients with resources to manage their finances and satisfy debts so they can support themselves and their families, and realize their dreams.','Contact to schedule an appointment. ([or use this link for online intake](https://docs.google.com/forms/d/e/1FAIpQLSdGNixCNrMgFnY2HtKfxLyXS1RbCKR6uYwx4Gg06V4gNJbJbg/viewform))','','',replace('* Defendant''s criminal history (obtain a copy of your DCH from the clerk of court, located at the Public Safety Building, before your appointment)\n* Proof of insurance (required at time of service)\n* Driving Abstract (obtained through the DOL (cost $13.00))\n* Valid State Issued ID (required at time of service)\n* Payment Plan (once your fines are removed from collections, you will be responsible for making the monthly payment, which will be set by the Court after we file your motion)','\n',char(10)),'222','332','No listed language support','333','222');
INSERT INTO Services VALUES('242','Post-Conviction Relief','97','97','Active','The consequences of a criminal conviction do not end when the sentence is served. You may be eligible to clear your record, restore your rights, and reduce the amount of LFO''s (legal financial obligations) you owe.','Contact for an appointment. ([or use this link for online intake](https://docs.google.com/forms/d/e/1FAIpQLSdGNixCNrMgFnY2HtKfxLyXS1RbCKR6uYwx4Gg06V4gNJbJbg/viewform))','','','Must have criminal history.','223','333','No listed language support','334','223');
INSERT INTO Services VALUES('224','EduCare','93','98','Active',replace('EduCare provides services seen in a typical preschool. You will find children coloring and learning their ABC’s during class. You will also find EduCare teachers that are qualified to help children recovering from the trauma of homelessness, or reconnecting with their moms. Teachers establish a positive partnership with parents to support the development, treatment and education of young children.\n\nPart of that partnership includes parenting groups where moms meet with staff to learn healthy parenting strategies and skills, breaking the cycle of poverty and homelessness. This enables our EduCare kiddos to flourish with stability in the classroom and at home.\n\nLicensed childcare on the TLC campus for infants, toddlers, and preschool children designed to meet the needs of formerly homeless children. EduCare provides a developmentally supportive environment, robust nutritional program, and trauma informed emotional support for this specific population of children.','\n',char(10)),'Apply Online','','','Unlisted','224','334','No listed language support','335','224');
INSERT INTO Services VALUES('225','Home Yard Cottages','93','98','Active','The Home Yard Cottages **provides affordable, permanent supportive housing units for families and individuals in 24 cottages.** Residents receive supportive services to help them maintain stability and meet goals. PSH is the term that Housing and Urban Development (HUD) uses to describe housing provided to persons who have a disability, are low-income and have been homeless','Call for appointment.','','','Unlisted','225','335','No listed language support','336','225');
INSERT INTO Services VALUES('226','Miryam''s House','93','98','Active',replace('Transitional housing is available through **Miryam’s House**, where nine women experiencing homelessness are encouraged down the path to recovery and stability through case management and life-skills education. Life at Miryam’s House includes wrap-around supportive services, one-on-one case management, life-skills education, and continuing support for residents through an Alumnae Program. Women eligible for housing are homeless. \n**To be referred to the program, a woman must complete the Singles Homeless Coordinated Assessment (SHCA) by calling SNAP at [(509) 456-7627] (tel:15094567627) **The Coordinated Assessment is based on need and prioritizes women fleeing domestic violence and those exiting a substance abuse or psychiatric treatment program. The SHCA may also refer you to other programs. The assessment does not guarantee placement at Miryam’s House; there is a significant wait for housing, but there is not a waiting list, as prioritization for housing is based on need.','\n',char(10)),'Call for an appointment.','','','Must complete the Singles Homeless Coordinated Assessment (SHCA) by calling SNAP at (509) 456-7627','226','336','No listed language support','337','226');
INSERT INTO Services VALUES('227','New Leaf Café','93','98','Active',replace('**New Leaf Café** is a barista training program located at our two full-service café locations. You will gain full espresso knowledge, retail sales skills, and food industry experience.\n\nOur focus on training low-income individuals ensures that more people are able to gain employment and to achieve stability and self-sufficiency for themselves and their families.\n\nAs a program of Transitions, New Leaf is also uniquely positioned to help families with the other primary obstacles to achieving and maintaining economic stability, including affordable childcare and housing support.','\n',char(10)),replace('Depends on location:\n\n* 906 W Main St. (First floor of the Spokane Central Library)\n    * Phone Number: **(509) 290-8623**\n    * Mondays - Thursdays, 9 AM - 3 PM\n    * Fridays, 10 AM - 3 PM\n* 930 N Monroe St. (First floor of the YWCA)\n    * Phone Number: **(509) 425-6443**\n    * Mondays - Fridays, 7 AM - 1 PM','\n',char(10)),'','','Must be enrolled in ICM with Transitions.','227','337','No listed language support','338','227');
INSERT INTO Services VALUES('228','Transitional Living Center (TLC)','93','98','Active',replace('TLC provides transitional housing with supportive services for women and children experiencing homelessness in 15 apartments and one permanent housing unit. TLC is dedicated to helping women with children experiencing homelessness create stability in their lives; participating families may live for up to twenty-four months in one-, two- and three-bedroom apartments.\n\nTLC Provides:\n\n* Case Management designed to create stability\n* 15 units for families: 1, 2, 3 bedroom apartments\n* Life Skills Training\n* On-site Computer/Technology Center\n* On-site Child Care at [EduCare](https://help4women.org/educare/)\n* Family Focused Program-Parenting Support\n* Supportive Community Environment','\n',char(10)),'To be referred to the program, a woman must complete an assessment through the Homeless Family Coordinated Assessment (HFCA) by calling Catholic Charities at [(509) 325-5005.](tel:15093255005)','','','In order to qualify for services, a family must be homeless, which means living on the streets, in a car, in a shelter, in other transitional housing, having a current eviction notice, or fleeing domestic violence. Each family must be motivated to create change in their life and willing to make a commitment towards addressing the issues that resulted in their homelessness. TLC works with the family as a whole and provides a safe environment in which the family may heal, grow and stabilize.','228','338','No listed language support','339','228');
INSERT INTO Services VALUES('229','Women''s Hearth','93','98','Active',replace('**Women’s Hearth** is a drop-in day center in downtown Spokane–a safe space for women who have experienced poverty, trauma and/or homelessness to find a “hearth” of welcome, respect, and community. Women’s Hearth provides activities, classes, social service referrals and housing-search case management in a compassionate and supportive environment 5 days a week. Participants also have access to phones, computers, internet, healthy food, hygiene supplies, and showers.\n\nThe Hearth is a safe, welcoming community that promotes growth and well-being in body, mind, and spirit for women of diverse backgrounds. It fosters nurturing relationships, encourages self-determination, and advocates for change in systems that oppress women.','\n',char(10)),replace('Mondays, 9 AM - 1:30 PM\nWednesdays, 11 AM - 3:30 PM\nTuesdays, Thursdays, Fridays, 9 AM - 3:30 PM','\n',char(10)),'','','Unlisted','229','339','No listed language support','340','229');
INSERT INTO Services VALUES('184','Connection Point','72','99','Active','Connecting refugees with resources and organizations according to their need and connecting willing sponsors with willing refugees for U4U program.','Monday/Wednesday/Friday, 10 AM - 5 PM','','','NONE','230','340','No listed language support','341','230');
INSERT INTO Services VALUES('185','Household Goods & Hygiene Products','72','99','Active','Free clothing, toys, shoes, hygiene products, furniture, mattress and more','Monday/Wednesday/Friday, 10 AM - 5 PM','','','NONE','231','341','No listed language support','342','231');
INSERT INTO Services VALUES('186','Housing Assistance','72','99','Active','Housing assistance (website does not include more details)','Monday/Wednesday/Friday, 10 AM - 5 PM','','','NONE','232','342','No listed language support','343','232');
