INSERT INTO Services VALUES('188','Legal Services','72','99','Active','Notary Service (suggested donation $10), and translation of paperwork and Interpreting of documents.','Monday/Wednesday/Friday, 10 AM - 5 PM','','','NONE','234','344','No listed language support','345','234');
INSERT INTO Services VALUES('189','Moving Assistance','72','99','Active','Ukrainian Closet owns a box truck that partially exists for the purpose of helping refugees move from home to home.','Monday/Wednesday/Friday, 10 AM - 5 PM','','','NONE','235','345','No listed language support','346','235');
INSERT INTO Services VALUES('190','Men''s Shelter','73','100','Active',replace('Public meals served daily (Lunch 12:00, Dinner 6:00)\nResidents must be able to pass a breathalyzer upon intake and UA/BA''s throughout their stay.\nOpen 7:00 a.m. - 10:00 p.m. (+ 24-hour emergency intake)\nNo pets allowed, except licensed service and therapy animals.\nCall ahead for medical clinic hours.','\n',char(10)),'Daily, 7 AM - 10 PM, (+24hr Emergency Intake)','','','Residents must be able to pass a breathalyzer upon intake and UA/BA''s throughout their stay.','236','346','No listed language support','347','236');
INSERT INTO Services VALUES('191','Soup Kitchen','73','100','Active','Lunches are served at 12:00pm and dinners are served at 6:00pm.','Daily, 12 PM & 6 PM','','','Must provide Social Security Number and be willing to have your picture taken for ID. You may attend up to three dinners with no obligation, but after that you will be asked to attend Chapel once before partaking in more dinners. You may attend any number of lunches, but if you are a man they will ask you to help out with a half-hour chore at the Men''s Shelter for each five lunches.','237','347','No listed language support','348','237');
INSERT INTO Services VALUES('192','Women & Children''s Shelter','73','101','Active',replace('Residents must be able to pass a breathalyzer upon intake and UA/BA''s throughout their stay.\nOpen 6:00 a.m. - 9:00 p.m. (+ 24-hour emergency intake)\nNo pets allowed, except licensed service and therapy animals.','\n',char(10)),'Daily, 6 AM - 9 PM, (+24hr Emergency Intake)','','','Residents must be able to pass a breathalyzer upon intake and UA/BA''s throughout their stay.','238','348','No listed language support','349','238');
INSERT INTO Services VALUES('193','Diaper & Formula Assistance','74','57','Active','Diapers, and depending on what has been donated, we may have formula, baby food, toys, books, clothing, and other miscellaneous items available for families. Diapers are given out for children up until their 4th birthday (unless a doctor’s note is provided in special cases). Formula (based on availability) is given out for babies up until their 1st birthday.',replace('Parents can to come into Vanessa Behan to get diapers and formula for their children, free of charge every 30 days.\n\nDiaper and formula assistance is offered in the business office from Monday-Friday 8:30 am – 4:30 pm (excluding posted holidays).','\n',char(10)),'','',replace('Parents picking up diapers and/or formula for the first time need to provide:\n- Picture ID for themselves (required every visit)\n- Documentation with the name and birthdate of the child on it.\n\nAcceptable forms of documentation for child:\n- Passport\n- Birth Certificate (Certified or Hospital Issued)\n- Immunization (Shot) Record\n- Molina Card\n\nNON Acceptable forms of documentation for child:\n- Provider One Card\n- Social Security Card\n- WIC Folder (unless name and DOB are included)\n\nAfter the first visit:\nParents only need to bring their ID every visit once they have provided the child’s name/birthdate documentation on the first visit. Diapers and formula will not be given to a parent who does not have some form of ID.','\n',char(10)),'239','349','No listed language support','350','239');
INSERT INTO Services VALUES('194','Parenting Classes','74','57','Active',replace('Vanessa Behan offers a series of 8-week parenting classes at various times during the year.\nCall 509.598.7490 to find out when our next class is available and to sign up!\n\nCircle of Security teaches parents a simple model for a secure, emotionally regulated relationship between parents and their children.  Through short video instruction and discussion, parents explore the foundations of secure attachment, where they might struggle with supporting healthy relationship, and how to reflect on and change those struggles.  Participants will attend 10.5 hours of instruction and receive a certificate of completion.\nFree on-site childcare during class.','\n',char(10)),replace('Call for current class times.\nApril 10 - May 22, 2024: Wednesdays, 6 PM - 7:30 PM','\n',char(10)),'','','MUST pre-register. Registration can be done via phone call (509-598-7490).','240','350','No listed language support','351','240');
INSERT INTO Services VALUES('195','Stay, Play & Learn','74','57','Active',replace('Vanessa Behan offers times when parents can bring their children to enjoy our beautiful Stay, Play & Learn space together. Come and engage with your child in a safe environment and meet other parents while you enjoy activities directed by our experienced staff.\n\nPlaygroup every Tuesday & Wednesday (see calendar for details)','\n',char(10)),replace('Weekdays, 9 AM - 12:30 PM\nTuesdays, Wednesdays & Thursdays, 9 AM - 12:30 PM & 1 PM - 4 PM','\n',char(10)),'','','NONE','241','351','No listed language support','352','241');
INSERT INTO Services VALUES('196','Disability Assistance Project','75','102','Active',replace('Mission: "To provide compassionate assistance to individuals, in a respectful manner, throughout every stage of the disability process, by providing open and honest advice and services, meeting individuals wherever they are comfortable and providing assistance in navigating the disability process while maintaining dignity and leveraging community partnerships to provide needed referrals and services."\n\nFree Services for Providers:\n     - Free Social Security Disability Trainings for Social Service Providers and Medical Professionals. \n     - Free consultations on specific Social Security Disability issues or questions to help you better assist your clients.\n     - Call or see below contact form if you are interested in scheduling a training or have any questions on Social Security.\n\nFree Services for Claimants:\n     - Free application status checks​\n     - Free online appeals\n     - Free DSHS state disability benefit applications\n     - Free legal consultation with an attorney\n     - Free assistance with overpayments and continuing disability reviews\n     - Free referrals to community service providers','\n',char(10)),replace('Wednesdays, 9 AM at 4320 E Trent Ave, Spokane, WA 99212\nThursdays, 9 AM at 32 W Pacific Ave, Spokane, WA 99201\nThursdays, 1 PM at 920 W 2nd Ave, Spokane, WA 99201','\n',char(10)),'','','NONE','242','352','No listed language support','353','242');
INSERT INTO Services VALUES('197','Clothing Outlet','76','103','Active','Sometimes you not only need a warm meal but you need clothes on your back. Our Clothing Closet is stocked with all sizes and styles of clothing from infants through adult sizes. The clothing closet is open the same hours as the food pantry and both are free and open to the local community.','Tuesdays, 9:30 AM - 11:30 AM','','','NONE','243','353','No listed language support','354','243');
INSERT INTO Services VALUES('198','WCN Food Pantry','76','103','Active','In order to help meet the needs of the community around us, we have opened a food pantry which is available to anyone in need.','Tuesdays, 9:30 AM - 11:30 AM','','','NONE','244','354','No listed language support','355','244');
INSERT INTO Services VALUES('199','Learn English','77','104','Active','Dive into English basics in just two weeks. Learn key vocabulary, basic grammar, and essential language skills to kickstart your journey. This is a 12-week program, and it is important to clarify that we are not an accredited school, and therefore, we will not provide any certification upon completion of the 12-week program.','Dependent on enrolled class.','','','Must be at least 17 years old.','245','355','No listed language support','356','245');
INSERT INTO Services VALUES('200','Curbside Grocery Service','78','105','Active',replace('Thanks to a generous grant from the Washington State Department of Agriculture''s We Feed WA Pilot Program, WCFR is able to offer its clients fresh protein, produce, and dairy products at every food distribution event through June of 2025. In fact, at least 50% of the products purchased with WSDA funds are sourced from local growers and Washington food businesses. Every week, fresh dairy products are delivered on the morning of our curbside event so that our program families benefit from the freshest products available. Because of this important funding, we have developed relationships with several local farmers and ranchers, including a female-owned and operated cattle ranch. We plan to distribute over one ton of grass-finished beef in the coming year.\n\nThe WSDA is committed to shaping a more effective, equitable approach to emergency food relief in Washington State. They bridge the gap between Washington growers and food businesses and Washington families by working with organizations like Women & Children''s Free Restaurant. We are extremely grateful for their generous support!\n\nIf you are an adult woman in need of food assistance, you may register for our services on our website. Please complete the registration form prior to joining the queue for curbside services. There is no qualifying or paperwork required, and registration is needed only once per year. Thank you and we look forward to serving you!','\n',char(10)),replace('Drive-up Service: Wednesdays, 12 PM - 2 PM\nWalk-up Service: Fridays, 10 AM - 11 AM','\n',char(10)),'','','This program is for adult women who have registered on their website.','246','356','No listed language support','357','246');
INSERT INTO Services VALUES('217','Cleone''s Closet','88','106','Active','Through the food pantry, free food is distributed to the Airway Heights and surrounding communities. Food is donated by 2nd Harvest, Safeway, Yokes, Grocery Outlet, Starbucks, farmers, etc. Through the closet clothing, furniture, houseware, etc. are provided to the community free of charge. The Resource Center provides information about available resources for community members.','Mondays / Fridays, 12 PM - 2 PM','','','Must reside within the boundaries of Airway Heights.','247','357','No listed language support','358','247');
INSERT INTO Services VALUES('218','Frieda’s Healing Center','88','106','Active',replace('**Frieda''s Healing Center** is a facility for abused women with children (boys up to 10 years old). Residents can stay up to six months. School aged children are required to attend school. Residents are required to participate in group counseling, individual coaching, and other programs offered by WHEN. The center is situated on 5 acres in a beautiful country setting. All furniture, appliances, linens, towels, miscellaneous supplies, etc. are donated. We do not receive state or federal funding and depend on our generous donors to provide funds for utilities and other operational expenses to keep the center open. We do not pay rent. Use of the home is donated courtesy of the Upper Columbia Conference Corporation and family of the late Frieda Cook.\n\nThe location of the healing center is confidential and not to be shared. The address we have here is the main office for WHEN.','\n',char(10)),'Call to schedule an intake interview.','','','Unlisted','248','358','No listed language support','359','248');
INSERT INTO Services VALUES('219','Men of Compassion (MOC)','88','107','Active',replace('MOC provides support, mentorship, healing and empowerment for abused and abusive men through support groups, crisis counseling, educational forums and other support services. **Groups are held at the Hillyard Baptist Church each 2nd and 4th Friday evening.**\n\nMOC also provides support, education, and personal skills training for men who are seeking recovery from controlling behaviors, abuse issues, dysfunctional patterns of thinking, feeling and doing, as they continue their journey of healing and empowerment.','\n',char(10)),'2nd & 4th Fridays of the month, 7 PM - 9 PM','','','Unlisted','249','359','No listed language support','360','249');
INSERT INTO Services VALUES('201','Refugee Membership Discount','80','19','Active','If you are a refugee you can apply for a free 3 month membership to the YMCA, which will give you access to everything a regular membership would.','Call during standard business hours.','','','NONE','250','360','No listed language support','361','250');
INSERT INTO Services VALUES('237','Computer Lab','81','19','Active','Available for walk-ins to any current clients. Call to schedule an appointment if not a current client.',replace('Mondays/Tuesdays/Thursdays, 9 AM - 4 PM\nWednesdays, 10:30 AM - 4 PM','\n',char(10)),'','','Must be a current client of YWCA.','251','361','No listed language support','362','251');
INSERT INTO Services VALUES('202','Domestic Violence Shelter','81','19','Active',replace('Our goal is to ensure the safety of survivors who are fleeing violence from an intimate partner by providing safe shelter, counseling, case management, education, and basic necessities like food, clothing, personal care items, and transportation. You and your children may need a temporary safe place away from your partner’s emotional abuse or violence. For many survivors, the shelter is a place to rest, sort out feelings, decide what is next, and get information and support to make changes.\n\nWe have a confidential safe shelter within the Spokane city limits as well as in the Spokane Valley.','\n',char(10)),'24 hours a day, 365 days a year.','','','Call (509) 326-2255 (24hr domestic violence hotline) for an assessment.','252','362','No listed language support','363','252');
INSERT INTO Services VALUES('231','Family Law','81','19','Active',replace('For assistance with divorce, custody, child support, and parentage, **complete our Civil Legal intake form either online or over the phone by calling [509-326-1190](tel:509-326-1190).**\nWe accept DV-related family law intakes starting Monday morning, and the form remains open until we reach our weekly case limit. Intakes are reviewed in order and the team will contact you later that week to schedule an appointment either in person, over the phone, or virtually.','\n',char(10)),'During regular business hours','','','Eligibility determined by intake form.','253','363','No listed language support','364','253');
INSERT INTO Services VALUES('235','FREE Preschool (Downtown 148)','81','19','Active','This free preschool is for eligible families with children 3 and 4 years old. All five ECEAP (pronounced “e-cap”) classrooms follow a school day model with learning from 8am – 3pm.','Weekdays, 8 AM - 3 PM','','','Must apply online (eligibility determined in application) or fill out attached PDF and mail in or deliver in person to the YWCA main building at: 930 N Monroe St, Spokane, WA 99201','254','364','No listed language support','365','254');
INSERT INTO Services VALUES('236','FREE Preschool (Downtown 157)','81','19','Active','This free preschool is for eligible families with children 3 and 4 years old. All five ECEAP (pronounced “e-cap”) classrooms follow a school day model with learning from 8am – 3pm.','Weekdays, 8 AM - 3 PM','','','Must apply online (eligibility determined in application) or fill out attached PDF and mail in or deliver in person to the YWCA main building at: 930 N Monroe St, Spokane, WA 99201','255','365','No listed language support','366','255');
INSERT INTO Services VALUES('234','FREE Preschool (Medical Lake)','81','108','Active','This free preschool is for eligible families with children 3 and 4 years old. All five ECEAP (pronounced “e-cap”) classrooms follow a school day model with learning from 8am – 3pm.','Weekdays, 8 AM - 3 PM','','','Must apply online (eligibility determined in application) or fill out attached PDF and mail in or deliver in person to the YWCA main building at: 930 N Monroe St, Spokane, WA 99201','256','366','No listed language support','367','256');
