INSERT INTO Services VALUES('230','Housing Advocacy Clinic','81','19','Active','Housing advocates can provide information about landlord/tenant issues, resources, safety planning, and referrals to other community partners.',replace('Mondays, 9 AM - 11 AM\n(Due to capacity, only the first 8 individuals can be served)','\n',char(10)),'','','Must be a survivor of Intimate Partner Violence (IPV)','258','368','No listed language support','369','258');
INSERT INTO Services VALUES('232','Legal Advocacy Walk-In Service','81','19','Active','For assistance with a Domestic Violence Protection Order, No Contact Order, or criminal case due to DV, **please call [509-477-3656](tel:509-477-3656) option #1.**','Mondays, 9 AM - 11 AM','','','Must require assistance with DV, No Contact Orders, Protection Orders, or criminal cases.','259','369','No listed language support','370','259');
INSERT INTO Services VALUES('203','Our Sister''s Closet','81','19','Active',replace('Our Sister''s Closet (OSC) is a free, donation-based women''s clothing & necessity boutique.\nOSC offers 90 minute appointments focused on outfitting a client with items to help them feel beautiful, boost confidence, and support achievement of personal and professional goals. On average, each client receives between 3 to 5 outfits, plus shoes, makeup, accessories, and personal hygiene products, as they are available.\nAppointments are available to anyone who is in need of this service.','\n',char(10)),'Call on Fridays, 9 AM - 12 PM to schedule an appointment.','','',replace('Call 509-326-1190 on Friday mornings between 9:00am and noon to schedule an appointment for the following week. Note: due to our limited capacity, calls received outside this time frame will not be returned.\n\nFree on-site childcare is available upon request. Please communicate this need during scheduling.','\n',char(10)),'260','370','No listed language support','371','260');
